INSERT INTO `qfb_agreement` VALUES ('1', '注册协议', '<p>银行卡协议</p><p><img src=\"http://dmallimg.dm188.cn/uploads/1/QXHgVZmdytwXpbh_R2KJ3_I0vOHNAus_.png\"></p><p><strong>租房协议范本一</strong></p><p>　　甲 方：</p><p>　　身份证号码：</p><p>　　地 址：</p><p>　　乙 方：</p><p>　　甲方将本人座落在***市***平方米房屋租给乙方使用，经双方协商，签订如下合同：</p><p>　　一、甲方将本人房屋租给乙方办公使用。</p><p>　　二、租赁期限视乙方实际需要而定。现暂定为3个月即从二00五年*月*日起至二00五年*月*日止。合同期间，单方不能随意更改、撕毁合同，也不能将给他人租用。本合同期满后，如乙方需要续约，必须提前一个月向甲方提出，在没有违约以及同等条件的前提下，可优先安排下轮出租。</p><p>　　三、每月租金共计人民币**元，一切税费由乙方负责。签订合同时，乙方需交押金**元给甲方，合同期满后，乙方没有，甲方必须将押金无条件退还给乙方。</p><p>　　四、租金交付方式：按月交付，每个月的*日前交清当月房租。逾期不交的，每天加收滞纳金人民币*元，超过**天以违约论处，合同自行终止，原交押金不予退还。</p><p>　　五、乙方在租用房屋期间所使用的水电费闭路电视费由乙方负责。</p><p>　　六、乙方在使用过程中，必须遵守社会公德，做到清洁卫生、文明礼貌、保持良好的秩序，不得高声喧哗影响他人休息。</p><p>　　七、合同期限内，如遇国家政策、规定变化或工程实际需要而无法履行合同的，双方均不以违约论处。</p><p>　　八、本合同经双方签字之日起生效。本合同一式两份，甲、乙双方各执一份。</p><p>　　甲 方：</p><p>　　乙 方：</p><p>　　**年***月***日</p><p><strong>租房协议范本二</strong></p><p>　　甲方(出租方)：_________________身份证：________________</p><p>　　乙方(承租方)：_________________身份证：________________</p><p>　　经双方协商一致，甲方将坐落于______________________________房屋出租给乙方XX使用。</p><p>　　一、租房从_____年___月___日起至______年___月___日止。</p><p>　　二、月租金为____元，缴租为____支付一次，人民币(大写)_________元(￥____元)，</p><p>　　以后应提前___天支付。</p><p>　　三、约定事项</p><p>　　1、乙方正式入住时，应及时的更换房门锁，若发生因门锁问题的意外与甲方无关。因用火不慎或使用不当引起的火灾、电、气灾害等非自然类的灾害所造成一切损失均由乙方负责。</p><p>　　2、乙方无权转租、转借、转卖该房屋，及屋内家具家电，不得擅自改动房屋结构，爱护屋内设施，如有人为原因造成破损丢失应维修完好，否则照价赔偿。并做好防火，防盗，防漏水，和阳台摆放、花盆的安全工作，若造成损失责任自负。</p><p>　　3、乙方必须按时缴纳房租，否则视为乙方违约。协议终止。</p><p>　　4、乙方应遵守居住区内各项<a href=\"http://www.liuxue86.com/wenmi/guizhangzhidu/\" target=\"_blank\">规章制度</a>，按时缴纳水、电、气、光纤、电话、物业管理等<a href=\"http://www.liuxue86.com/feiyong/\" target=\"_blank\">费用</a>。乙方交保证金________元给甲方，乙方退房时交清水，电，气，光纤和物业管理等费用及屋内设施家具、家电无损坏，下水管道，厕所无堵漏。甲方如数退还保证金。</p><p>　　5、甲方保证该房屋无产权纠纷。如遇拆迁，乙方无条件搬出，已交租金甲方按未满天数退还。</p><p>　　6、备注;___________________________________________________________________________<span class=\"redactor-invisible-space\">_________________________<span class=\"redactor-invisible-space\">_________________________<span class=\"redactor-invisible-space\">_________________________<span class=\"redactor-invisible-space\">_________________________<span class=\"redactor-invisible-space\">_________________________<span class=\"redactor-invisible-space\">_________________________<span class=\"redactor-invisible-space\">_________________________<span class=\"redactor-invisible-space\">_________________________</span></span></span></span></span></span></span></span></p><p>　　四、本合同一式两份，自双方签字之日起生效。另水;_____吨气;____立方电;___度</p><p>　　甲方签章(出租方)：乙方签章(承租方)：</p><p>　　电话;电话;</p><p>　　______年______月______日</p><p><strong>租房协议范本三</strong></p><p>　　出租方：______(以下简称甲方)</p><p>　　身份证：_________________</p><p>　　承租方：______(以下简称乙方)</p><p>　　身份证：_________________</p><p>　　根据甲、乙双方在自愿、平等、互利的基础上，经协商一致，为明确双方之间的权利义务关系，就甲方将其合法拥有的房屋出租给乙方使用，乙方承租甲方房屋事宜，订立本合同。</p><p>　　一、房屋地址：塘南新村北区120幢401室内的一间单间。用于普通住房。</p><p>　　二、租赁期限及约定</p><p>　　1、该房屋租赁期共一年。自_____年_____月_____日起至_____年_____月_____日止。</p><p>　　2、房屋租金：每月_____元。按月付款，每月提前五天付款。另付押金_____元，共计______元.</p><p>　　(大写：_____万_____仟_____佰_____拾_____元整)</p><p>　　房屋终止，甲方验收无误后，将押金退还乙方，不计利息。</p><p>　　3、乙方向甲方承诺，租赁该房屋仅作为普通住房使用。</p><p>　　4、租赁期满，甲方有权收回出租房屋，乙方应如期交还。乙方如要求续租，则必须在租赁期满前一个月内<a href=\"http://www.liuxue86.com/tongzhi/\" target=\"_blank\">通知</a>甲方，经甲方同意后，重新签订<a href=\"http://www.liuxue86.com/hetongfanben/zulin/\" target=\"_blank\">租赁合同</a>。</p><p>　　三、房屋修缮与使用</p><p>　　1、在租赁期内，甲方应保证出租房屋的使用安全。乙方应合理使用其所承租的房屋及其附属设施。如乙方因使用不当造成房屋及设施损坏的，乙方应负责修复或给予经济赔偿。</p><p>　　2、该房屋及所属设施的维修责任除双方在本合同及补充条款中约定外，均由甲方负责(但乙方使用不当除外)。甲方进行维修须提前七天通知乙方，乙方应积极协助配合。</p><p>　　3、乙方因使用需要，在不影响房屋结构的前提下，可以对房屋进行装修装饰，但其设计规模、范围、工艺、用料等方案应事先征得甲方的同意后方可施工。租赁期满后，依附<a href=\"http://tool.liuxue86.com/shiren_view_9b85d143ac9b85d1/\" target=\"_blank\">于房</a>屋的装修归甲方所有。对乙方的装修装饰部分甲方不负有修缮的义务。</p><p>　　四、房屋的转让与转租</p><p>　　1、租赁期间，未经甲方书面同意，乙方不得擅自转租、转借承租房屋。</p><p>　　2、甲方同意乙方转租房屋的，应当单独订立补充协议，乙方应当依据与甲方的书面协议转租房屋。</p><p>　　五、乙方违约的处理规定</p><p>　　在租赁期内，乙方有下列行为之一的，甲方有权终止合同，收回该房屋，乙方应向甲方支付合同总租金20%的违约金，若支付的违约金不足弥补甲方损失的，乙方还应负责赔偿直至达到弥补全部损失为止。</p><p>　　(1) 未经甲方书面同意，擅自将房屋转租、转借给他人使用的;</p><p>　　(2) 未经甲方同意，擅自拆改变动房屋结构或损坏房屋，且经甲方通知，在规定期限内仍未纠正并修复的;</p><p>　　(3) 擅自改变本合同规定的租赁用途或利用该房屋进行违法活动的;</p><p>　　(4) 拖欠房租累计一个月以上的。</p><p>　　六、本协议一式两份，甲.乙各执一份，签字后即行生效。</p><p>　　七、其他说明：水电数字由甲乙双方与其他承租方平均分配</p><p>　　(入住时的水电数字：电________，水________，)</p><p>　　甲方签字：　　　　　　乙方签字：</p><p>　　联系方式：　　　　　　联系方式：</p><ul><li>12121212121212121212121</li></ul><p>1&gt;zhong测试机房里看电视剧弗兰克斯的</p><p>2》斯蒂芬森的加快立法集散地立刻反击</p>', '1/oWaJcsgJT_nqYeewV5uXD9K0MFg20pLS.jpg', '1460013737', '0', '0');
INSERT INTO `qfb_agreement` VALUES ('2', '银行卡协议', '<p>银行卡协议\r\n</p><p><img src=\"http://dmallimg.dm188.cn/uploads/1/QXHgVZmdytwXpbh_R2KJ3_I0vOHNAus_.png\"></p><p><strong>租房协议范本一</strong>\r\n</p><p>　　甲 方：\r\n</p><p>　　身份证号码：\r\n</p><p>　　地 址：\r\n</p><p>　　乙 方：\r\n</p><p>　　甲方将本人座落在***市***平方米房屋租给乙方使用，经双方协商，签订如下合同：\r\n</p><p>　　一、甲方将本人房屋租给乙方办公使用。\r\n</p><p>　　二、租赁期限视乙方实际需要而定。现暂定为3个月即从二00五年*月*日起至二00五年*月*日止。合同期间，单方不能随意更改、撕毁合同，也不能将给他人租用。本合同期满后，如乙方需要续约，必须提前一个月向甲方提出，在没有违约以及同等条件的前提下，可优先安排下轮出租。\r\n</p><p>　　三、每月租金共计人民币**元，一切税费由乙方负责。签订合同时，乙方需交押金**元给甲方，合同期满后，乙方没有，甲方必须将押金无条件退还给乙方。\r\n</p><p>　　四、租金交付方式：按月交付，每个月的*日前交清当月房租。逾期不交的，每天加收滞纳金人民币*元，超过**天以违约论处，合同自行终止，原交押金不予退还。\r\n</p><p>　　五、乙方在租用房屋期间所使用的水电费闭路电视费由乙方负责。\r\n</p><p>　　六、乙方在使用过程中，必须遵守社会公德，做到清洁卫生、文明礼貌、保持良好的秩序，不得高声喧哗影响他人休息。\r\n</p><p>　　七、合同期限内，如遇国家政策、规定变化或工程实际需要而无法履行合同的，双方均不以违约论处。\r\n</p><p>　　八、本合同经双方签字之日起生效。本合同一式两份，甲、乙双方各执一份。\r\n</p><p>　　甲 方：\r\n</p><p>　　乙 方：\r\n</p><p>　　**年***月***日\r\n</p><p><strong>租房协议范本二</strong>\r\n</p><p>　　甲方(出租方)：_________________身份证：________________\r\n</p><p>　　乙方(承租方)：_________________身份证：________________\r\n</p><p>　　经双方协商一致，甲方将坐落于______________________________房屋出租给乙方XX使用。\r\n</p><p>　　一、租房从_____年___月___日起至______年___月___日止。\r\n</p><p>　　二、月租金为____元，缴租为____支付一次，人民币(大写)_________元(￥____元)，\r\n</p><p>　　以后应提前___天支付。\r\n</p><p>　　三、约定事项\r\n</p><p>　　1、乙方正式入住时，应及时的更换房门锁，若发生因门锁问题的意外与甲方无关。因用火不慎或使用不当引起的火灾、电、气灾害等非自然类的灾害所造成一切损失均由乙方负责。\r\n</p><p>　　2、乙方无权转租、转借、转卖该房屋，及屋内家具家电，不得擅自改动房屋结构，爱护屋内设施，如有人为原因造成破损丢失应维修完好，否则照价赔偿。并做好防火，防盗，防漏水，和阳台摆放、花盆的安全工作，若造成损失责任自负。\r\n</p><p>　　3、乙方必须按时缴纳房租，否则视为乙方违约。协议终止。\r\n</p><p>　　4、乙方应遵守居住区内各项<a href=\"http://www.liuxue86.com/wenmi/guizhangzhidu/\" target=\"_blank\">规章制度</a>，按时缴纳水、电、气、光纤、电话、物业管理等<a href=\"http://www.liuxue86.com/feiyong/\" target=\"_blank\">费用</a>。乙方交保证金________元给甲方，乙方退房时交清水，电，气，光纤和物业管理等费用及屋内设施家具、家电无损坏，下水管道，厕所无堵漏。甲方如数退还保证金。\r\n</p><p>　　5、甲方保证该房屋无产权纠纷。如遇拆迁，乙方无条件搬出，已交租金甲方按未满天数退还。\r\n</p><p>　　6、备注;___________________________________________________________________________<span class=\"redactor-invisible-space\">_________________________<span class=\"redactor-invisible-space\">_________________________<span class=\"redactor-invisible-space\">_________________________<span class=\"redactor-invisible-space\">_________________________<span class=\"redactor-invisible-space\">_________________________<span class=\"redactor-invisible-space\">_________________________<span class=\"redactor-invisible-space\">_________________________<span class=\"redactor-invisible-space\">_________________________<span class=\"redactor-invisible-space\"></span></span></span></span></span></span></span></span></span>\r\n</p><p>　　四、本合同一式两份，自双方签字之日起生效。另水;_____吨气;____立方电;___度\r\n</p><p>　　甲方签章(出租方)：乙方签章(承租方)：\r\n</p><p>　　电话;电话;\r\n</p><p>　　______年______月______日\r\n</p><p><strong>租房协议范本三</strong>\r\n</p><p>　　出租方：______(以下简称甲方)\r\n</p><p>　　身份证：_________________\r\n</p><p>　　承租方：______(以下简称乙方)\r\n</p><p>　　身份证：_________________\r\n</p><p>　　根据甲、乙双方在自愿、平等、互利的基础上，经协商一致，为明确双方之间的权利义务关系，就甲方将其合法拥有的房屋出租给乙方使用，乙方承租甲方房屋事宜，订立本合同。\r\n</p><p>　　一、房屋地址：塘南新村北区120幢401室内的一间单间。用于普通住房。\r\n</p><p>　　二、租赁期限及约定\r\n</p><p>　　1、该房屋租赁期共一年。自_____年_____月_____日起至_____年_____月_____日止。\r\n</p><p>　　2、房屋租金：每月_____元。按月付款，每月提前五天付款。另付押金_____元，共计______元.\r\n</p><p>　　(大写：_____万_____仟_____佰_____拾_____元整)\r\n</p><p>　　房屋终止，甲方验收无误后，将押金退还乙方，不计利息。\r\n</p><p>　　3、乙方向甲方承诺，租赁该房屋仅作为普通住房使用。\r\n</p><p>　　4、租赁期满，甲方有权收回出租房屋，乙方应如期交还。乙方如要求续租，则必须在租赁期满前一个月内<a href=\"http://www.liuxue86.com/tongzhi/\" target=\"_blank\">通知</a>甲方，经甲方同意后，重新签订<a href=\"http://www.liuxue86.com/hetongfanben/zulin/\" target=\"_blank\">租赁合同</a>。\r\n</p><p>　　三、房屋修缮与使用\r\n</p><p>　　1、在租赁期内，甲方应保证出租房屋的使用安全。乙方应合理使用其所承租的房屋及其附属设施。如乙方因使用不当造成房屋及设施损坏的，乙方应负责修复或给予经济赔偿。\r\n</p><p>　　2、该房屋及所属设施的维修责任除双方在本合同及补充条款中约定外，均由甲方负责(但乙方使用不当除外)。甲方进行维修须提前七天通知乙方，乙方应积极协助配合。\r\n</p><p>　　3、乙方因使用需要，在不影响房屋结构的前提下，可以对房屋进行装修装饰，但其设计规模、范围、工艺、用料等方案应事先征得甲方的同意后方可施工。租赁期满后，依附<a href=\"http://tool.liuxue86.com/shiren_view_9b85d143ac9b85d1/\" target=\"_blank\">于房</a>屋的装修归甲方所有。对乙方的装修装饰部分甲方不负有修缮的义务。\r\n</p><p>　　四、房屋的转让与转租\r\n</p><p>　　1、租赁期间，未经甲方书面同意，乙方不得擅自转租、转借承租房屋。\r\n</p><p>　　2、甲方同意乙方转租房屋的，应当单独订立补充协议，乙方应当依据与甲方的书面协议转租房屋。\r\n</p><p>　　五、乙方违约的处理规定\r\n</p><p>　　在租赁期内，乙方有下列行为之一的，甲方有权终止合同，收回该房屋，乙方应向甲方支付合同总租金20%的违约金，若支付的违约金不足弥补甲方损失的，乙方还应负责赔偿直至达到弥补全部损失为止。\r\n</p><p>　　(1) 未经甲方书面同意，擅自将房屋转租、转借给他人使用的;\r\n</p><p>　　(2) 未经甲方同意，擅自拆改变动房屋结构或损坏房屋，且经甲方通知，在规定期限内仍未纠正并修复的;\r\n</p><p>　　(3) 擅自改变本合同规定的租赁用途或利用该房屋进行违法活动的;\r\n</p><p>　　(4) 拖欠房租累计一个月以上的。\r\n</p><p>　　六、本协议一式两份，甲.乙各执一份，签字后即行生效。\r\n</p><p>　　七、其他说明：水电数字由甲乙双方与其他承租方平均分配\r\n</p><p>　　(入住时的水电数字：电________，水________，)\r\n</p><p>　　甲方签字：　　　　　　乙方签字：\r\n</p><p>　　联系方式：　　　　　　联系方式：\r\n</p><ul>\r\n	<li>12121212121212121212121</li>\r\n</ul><p>1&gt;zhong测试机房里看电视剧弗兰克斯的\r\n</p><p>2》斯蒂芬森的加快立法集散地立刻反击\r\n</p>', '1/ebTP0EkP0jzoRERnirDYKf1xLERkMdqE.jpg', '1460088702', '0', '0');
INSERT INTO `qfb_agreement` VALUES ('3', '充值协议', '<p>充值协议</p><p><a href=\"http://dmallapi.dm188.cn/v200/site/getagreement?type=1&channelId=1&login_ver=1.5.0&sign=bc562efca05527624d0d5bc422e02129&timeStamp=1460702435177&imei=068325068125889\">http://dmallapi.dm188.cn/v200/site/getagreement?ty...</a><br></p>', '1/rYPYSHsLbZplHmPMz2uIisasQPgz0q4x.jpg', '1460084421', '0', '0');
INSERT INTO `qfb_agreement` VALUES ('6', '新手定期协议新手尊投投资服务协议', '<h2>定期一</h2><h2>重庆市房屋租赁合同(一)</h2><p>　　出租方(以下简称甲方)： 承租方(以下简称乙方)：</p><p>　　根据国家有关法律法规，和本市有关规定，甲，乙双方在自愿，平等，互利的基础上，就甲方将其合法拥有的房屋出租给乙方使用，乙方承租使用甲方房屋事宜订立本合同。</p><p>　　一，房屋的座落面积</p><p>　　1-1，甲方将其合法拥有的座落于北京市 的房屋出租给乙方使用。</p><p>　　1-2，甲方将出租的房屋房型为 室 厅 卫。</p><p>　　1-3，甲方出租给乙方使用的该房屋建筑面积共 平方米。</p><p>　　二，租赁用途</p><p>　　2-1，乙方向甲方承诺租赁该房屋仅作为 使用。</p><p>　　2-2，在租赁期限内，未事前征得甲方的书面同意，乙方不得擅自改变该房屋的使用用途。</p><p>　　三，租赁期限</p><p>　　3-1，该房屋租赁期为 个月，自 年 月 日起，至 年 月 日止。</p><p>　　3-2，租赁期满，甲方有权收回全部出租房屋，乙方应如期交还。乙方如要求续租，则必须在租赁期满前的 个月向甲方提出书面意向，双方可在对租金期限重新协商后，签订新的<a href=\"http://www.liuxue86.com/hetongfanben/zulin/\" target=\"_blank\">租赁合同</a>。</p><p>　　四，租金及支付方式</p><p>　　4-1，该房屋的月租金为人民币： 万 仟 佰 拾 元整，租金以 方式支付。</p><p>　　4-2，双方议定首期付 个月租金，押 个月押金，以后按每 个月结算一次，提前 天支付下次房租，押金不变，甲方在收到乙方租金(包括押金)后必须开具 予乙方。</p><p>　　五，其他<a href=\"http://www.liuxue86.com/feiyong/\" target=\"_blank\">费用</a></p><p>　　5-1，乙方在租赁期内实际使用的水费，电费，煤气费，电话费，有线电视费及 等费用应由乙方自行承担，并按单如期缴纳。</p><p>　　5-2，乙方应把已缴纳过的单据复印件交与甲方。</p><p>　　六，甲方的义务</p><p>　　6-1，甲方需按时将房屋及附属设施交付乙方使用。</p><p>　　6-2，房屋及附属设施如非乙方的过失和错误使用而受到损坏时，甲方有修缮的责任并承担相关的费用。</p><p>　　6-3，甲方应定期对房屋和设施进行维修保养(提前10天<a href=\"http://www.liuxue86.com/tongzhi/\" target=\"_blank\">通知</a>乙方)。</p><p>　　6-4，甲方应保证所出租房屋权属清楚，无共同人意见，无使用之纠纷。</p><p>　　6-5，在甲方将房屋交给乙方使用之前，应负责配备租赁房屋内的装修，灯具，厨房设备等，其所有权归甲方所有。</p><p>　　七，乙方的义务</p><p>　　7-1，乙方在租赁期内保证在该租赁房屋内的所有活动均能合乎中国的法律及该地点管理规定，不作任何违法之行为。</p><p>　　7-2，乙方应按合同的规定，按时支付租金及其他各项费用。</p><p>　　7-3，未经甲方同意，乙方不能改变租赁房屋的结构装修，乙方不得将承租的房屋转租，并爱护使用租赁的房屋，如因乙方的过失或者过错是房屋设施受到损坏，乙方应负责赔偿。</p><p>　　7-4，乙方应按合同约定合法使用租赁房屋，不得擅自改变使用性质，不得存放危险物品及国家明文规定的不合法之物品，如因此发生损害，乙方应承担全部责任。</p><p>　　八，甲方提供的设备如下(或另附清单说明)：</p><p>　　1，电话</p><p>　　2，淋浴器</p><p>　　3，空调</p><p>　　4，彩电</p><p>　　5，冰箱</p><p>　　6，洗衣机</p><p>　　7，家具</p><p>　　8，其他 。</p><p>　　水，电，煤气表现数字：水表 ，电表 ，煤气表 。</p><p>　　九，押金及违约金</p><p>　　9-1，为确保房屋及其所属设施之安全与完好及租赁期内相关费用之如期结算，甲乙双方同意本合同的押金为：(人民币大写) 万 仟 佰 拾 元整。</p><p>　　9-2，甲，乙双方如有特殊情况需提前终止合同，必须提前一个月通知对方和中介方，待双方同意后，方可办理退房手续。若甲方违约，除退还给乙方保证金外，还需支付给乙方上述金额的违约金，反之，若乙方违约，则甲方有权不退还保证金。</p><p>　　9-3，凡在执行本合同或与本合同有关的事情时双方发生争议，应首先友好协商，协商不成，可向当地人<a href=\"http://www.liuxue86.com/sifa/minfa/\" target=\"_blank\">民法</a>院提起诉讼，中介方协助双方所需见证工作，但不承担任何法律和经济责任。</p><p>　　十，其他条款</p><p>　　10-1，甲乙双方在签署本合同时，具有完全民事行为能力，对各自权利义务责任清楚明白，并按合同规定严格执行如一方违反本合同，另一方有权按合同规定索赔。</p><p>　　10-2，本合同未尽事宜，经双方协商一致，可订立补充条款，本合同及其补充条款和附件设备清单内空格部分填写的文字与打印文字具有同等效力。</p><p>　　10-3，本合同连补充条款及附件共 页，壹式 份。其中，甲乙双方各执 份，中介方壹份，均具有同等效力。签字即生效。</p><p>　　出租方(甲方)： 承租方(乙方)： 中介方：</p><p>　　联系地址： 联系地址： 联系地址：</p><p>　　电话： 电话： 电话：</p><p>　　证件号： 证件号：</p><p>　　产权证号： 代表人/代理人： 经办人：</p><p>　　签约日期： 签约日期： 签约日期：</p><h2>　　重庆市房屋租赁合同(二)</h2><p>　　出租人(以下简称甲方)：</p><p>　　【法定代表人】【负责人】： 国籍：</p><p>　　【身份证】【<a href=\"http://visa.liuxue86.com/huzhaobanli/\" target=\"_blank\">护照</a>】【营业执照注册号】【其他： 】：</p><p>　　通讯地址：</p><p>　　邮政编码： 联系电话： (手机) ;</p><p>　　【代理人】： 国籍：</p><p>　　【身份证】【护照】【营业执照注册号】【其他： 】：</p><p>　　通讯地址：</p><p>　　邮政编码： 联系电话： (手机) ;</p><p>　　承租人(以下简称乙方)：</p><p>　　【法定代表人】【负责人】： 国籍：</p><p>　　【身份证】【护照】【营业执照注册号】【其他： 】：</p><p>　　通讯地址：</p><p>　　邮政编码： 联系电话： (手机) ;</p><p>　　【代理人】： 国籍：</p><p>　　【身份证】【护照】【营业执照注册号】【其他： 】：</p><p>　　通讯地址：</p><p>　　邮政编码： 联系电话： (手机) ;</p><p>　　根据《中华人民共和国<a href=\"http://www.liuxue86.com/hetongfanben/hetongfa/\" target=\"_blank\">合同法</a>》、《中华人民共和国城市房地产管理法》及相关法律、法规的规定，甲乙双方在自愿、平等、公平和诚实信用的基础上，经协商一致，就乙方承租甲方可依法出租的房屋事宜，签订本合同。</p><p>　　一、出租房屋基本情况</p><p>　　(一)房屋坐落：</p><p>　　(二)该房屋权属<a href=\"http://www.liuxue86.com/fanwen/zhengming/\" target=\"_blank\">证明</a>名称：</p><p>　　编号： 。</p><p>　　(三)该房屋建筑面积： 平方米，套内建筑面积： 平方米。</p><p>　　(四)该房屋权属证明记载用途： 。</p><p>　　(五)该房屋现有装修及设施设备情况，由甲、乙双方分别在本合同附件中列明。除双方另有约定外，该附件作为甲方按照本合同约定交付乙方使用和乙方在本合同租赁期满交还该房屋的验证凭据。</p><p>　　二、租赁期限</p><p>　　(一)该房屋租赁期限共 个月，自 年 月 日至 年</p><p>　　月 日止。</p><p>　　(二)租赁期满，甲方有权收回该房屋，乙方应如期交还。乙方需要继续承租该房屋的，则应于租赁期届满前 日通知甲方。</p><p>　　三、租金及支付方式</p><p>　　(一)该房屋租金为： 元/(□月□季□半年□年);本合同期内租金总额为： 元。(大写： )</p><p>　　(二)该房屋租金支付方式：</p><p>　　四、押金及其他费用的约定</p><p>　　(一)甲方交付该房屋时，乙方应向甲方支付房屋租赁押金。押金为 元(大写： )。甲方收取押金后应向乙方出具收款凭证。</p><p>　　(二)租赁期间，使用该房屋所发生的水、电、燃气、通讯费用由 方承担;有线电视、物业管理费用由 方承担。</p><p>　　(三)租赁期内，因该房屋租赁产生的税费按国家法律、法规规定承担。</p><p>　　(四)租赁期满或合同解除后，甲方应退还乙方支付的房屋租赁押金。</p><p>　　(五)其他约定： 。</p><p>　　五、成交方式</p><p>　　甲乙双方系通过以下第 种方式成交。</p><p>　　(一)自行成交。</p><p>　　(二)房地产经纪机构成交。提供服务的房地产经纪机构名称为：</p><p>　　，备案证书号为：</p><p>　　通讯地址：</p><p>　　邮政编码： 联系电话：</p><p>　　提供服务的房地产经纪人员职业资格为</p><p>　　注册证号</p><p>　　六、关<a href=\"http://tool.liuxue86.com/shiren_view_9b85d143ac9b85d1/\" target=\"_blank\">于房</a>屋转租与出售的约定</p><p>　　(一)未经甲方书面同意，乙方不得将房屋转租、转借他人。</p><p>　　(二)租赁期间，甲方出售该房屋的应在出售前 日书面通知乙方，在同等条件下，乙方有优先购买权。</p><p>　　七、关于甲方交房的约定</p><p>　　(一)甲方应于 年 月 日前将房屋按约定条件交付给乙方。《现有装修、附属设施及设备清单》经双方交验签字盖章并移交房门钥匙后视为交付完成。</p><p>　　(二)甲方延迟交房超 日的，乙方有权单方解除合同。乙方要求继续履行合同的,合同继续履行，甲方自约定交房<a href=\"http://www.liuxue86.com/shijian/\" target=\"_blank\">时间</a>之日起至实际交付房屋之日止，向乙方每日按已付租金的 %支付违约金。</p><p>　　八、关于乙方付款的约定</p><p>　　(一)乙方应按本合同第三条的约定向甲方如期支付租金。</p><p>　　(二)乙方未按约定时间支付租金超 日，甲方有权单方解除合同。甲方不解除合同的,乙方应向甲方按应付租金的 %支付违约金。</p><p>　　九、其他约定</p><p>　　(一)租赁期内，甲方应保障该房屋及其附属设施处于正常使用的状态，并承担乙方正常使用下房屋及附属设施损坏或故障的修复义务;甲方不承担房屋的维修义务,致使乙方无法正常使用房屋及附属设施的，乙方有权单方解除合同;对于乙方的装修、改善和增设的他物甲方不承担维修义务。</p><p>　　(二)乙方应合理使用并爱护该房屋及其附属设施。因乙方保管不当或不合理使用，致使该房屋及其附属设施发生损坏或故障的,乙方应负责维修或承担赔偿责任;乙方保管不当或不合理使用导致附属物品、设备设施损坏并拒绝赔偿的，甲方有权单方解除合同。</p><p>　　(三)在租赁期内未征得甲方书面同意以及按规定须经有关部门审批但未核准前，乙方不得擅自改变房屋用途。不得在该房屋内进行违反法律法规及政府对出租房屋用途有关规定的行为。乙方擅自改变房屋用途，甲方有权单方解除合同。</p><p>　　(四)租赁期内，甲方提前收回该房屋或乙方提前退租的，应提前 日通知对方，并按月租金的 %向对方支付违约金，属甲方违约的甲方还应退还相应的租金。</p><p>　　(五)租赁到期或合同解除后，乙方应将房屋钥匙及正常使用状态下的附件中所列物品交还给甲方，乙方应当保证该房屋附属设施、设备、装饰装修保持良好，结清应由乙方支付的相关费用。</p><p>　　(六)甲方保证已如实介绍该房屋权属状况、附属设施设备、装饰装修情况，出租该房屋不违反国家法律法规的相关规定及有权决定此租赁事宜。乙方保证已对上述房地产作充分了解并实地看房，对该房屋现状无异议，愿意租赁该房屋。</p><p>　　(七)经甲、乙双方协商一致，可以解除本合同。</p><p>　　(八)关于租赁期间房屋被征收的约定：</p><p>　　十、登记备案</p><p>　　甲乙双方自本合同签订之日起三十日内，由□甲乙双方共同 □甲方 □乙方按相关规定向房屋所在地房地产行政管理部门申请办理房屋租赁登记备案。</p><p>　　租赁期内，房屋租赁登记备案内容发生变更的，甲乙双方应当在十日内，到原租赁登记备案的部门办理房屋租赁登记备案变更手续。</p><p>　　租赁期满房屋续租或者租赁终止的，由□甲乙双方共同 □甲方 □乙方在期满后三十日内到原租赁登记备案的部门办理房屋租赁登记备案的延续或者注销手续。</p><p>　　十一、争议的解决方式</p><p>　　甲、乙双方在履行本合同过程中发生争议的，应协商解决;协商不成的，可依法选择：□向人民法院起诉 □向重庆仲裁委员会申请仲裁。</p><p>　　十二、补充约定</p><p>　　十三、附则</p><p>　　(一)本合同所列地址为各方准确联系地址，相关<a href=\"http://www.liuxue86.com/wenshuxiezuo/\" target=\"_blank\">文书</a>送达到该地址，即视为送达给其本人。任何一方地址变更，应及时书面通知相关方，否则自行承担相关责任。</p><p>　　(二)本合同一式 份，甲、乙双方各执 份， 、和登记机构各执一份，均具有同等法律效力。本合同经双方签字盖章之日起生效。</p><p>　　出租人： 承租人：</p><p>　　法定代表人(负责人)： 法定代表人(负责人)：</p><p>　　委托代理人： 委托代理人：</p><p>　　签约时间： 年 月 日 签约时间： 年 月 日</p><p>　　签约地点： 签约地点：</p>', '1/Q8D5jJXOEJ4RzqPxfCmsVIf7eeQzdaom.png', '1460084704', '2', '0');
INSERT INTO `qfb_agreement` VALUES ('7', '活期理财协议', '<p>活期</p><h2>重庆市房屋租赁合同(一)</h2><p>　　出租方(以下简称甲方)： 承租方(以下简称乙方)：</p><p>　　根据国家有关法律法规，和本市有关规定，甲，乙双方在自愿，平等，互利的基础上，就甲方将其合法拥有的房屋出租给乙方使用，乙方承租使用甲方房屋事宜订立本合同。</p><p>　　一，房屋的座落面积</p><p>　　1-1，甲方将其合法拥有的座落于北京市 的房屋出租给乙方使用。</p><p>　　1-2，甲方将出租的房屋房型为 室 厅 卫。</p><p>　　1-3，甲方出租给乙方使用的该房屋建筑面积共 平方米。</p><p>　　二，租赁用途</p><p>　　2-1，乙方向甲方承诺租赁该房屋仅作为 使用。</p><p>　　2-2，在租赁期限内，未事前征得甲方的书面同意，乙方不得擅自改变该房屋的使用用途。</p><p>　　三，租赁期限</p><p>　　3-1，该房屋租赁期为 个月，自 年 月 日起，至 年 月 日止。</p><p>　　3-2，租赁期满，甲方有权收回全部出租房屋，乙方应如期交还。乙方如要求续租，则必须在租赁期满前的 个月向甲方提出书面意向，双方可在对租金期限重新协商后，签订新的<a href=\"http://www.liuxue86.com/hetongfanben/zulin/\" target=\"_blank\">租赁合同</a>。</p><p>　　四，租金及支付方式</p><p>　　4-1，该房屋的月租金为人民币： 万 仟 佰 拾 元整，租金以 方式支付。</p><p>　　4-2，双方议定首期付 个月租金，押 个月押金，以后按每 个月结算一次，提前 天支付下次房租，押金不变，甲方在收到乙方租金(包括押金)后必须开具 予乙方。</p><p>　　五，其他<a href=\"http://www.liuxue86.com/feiyong/\" target=\"_blank\">费用</a></p><p>　　5-1，乙方在租赁期内实际使用的水费，电费，煤气费，电话费，有线电视费及 等费用应由乙方自行承担，并按单如期缴纳。</p><p>　　5-2，乙方应把已缴纳过的单据复印件交与甲方。</p><p>　　六，甲方的义务</p><p>　　6-1，甲方需按时将房屋及附属设施交付乙方使用。</p><p>　　6-2，房屋及附属设施如非乙方的过失和错误使用而受到损坏时，甲方有修缮的责任并承担相关的费用。</p><p>　　6-3，甲方应定期对房屋和设施进行维修保养(提前10天<a href=\"http://www.liuxue86.com/tongzhi/\" target=\"_blank\">通知</a>乙方)。</p><p>　　6-4，甲方应保证所出租房屋权属清楚，无共同人意见，无使用之纠纷。</p><p>　　6-5，在甲方将房屋交给乙方使用之前，应负责配备租赁房屋内的装修，灯具，厨房设备等，其所有权归甲方所有。</p><p>　　七，乙方的义务</p><p>　　7-1，乙方在租赁期内保证在该租赁房屋内的所有活动均能合乎中国的法律及该地点管理规定，不作任何违法之行为。</p><p>　　7-2，乙方应按合同的规定，按时支付租金及其他各项费用。</p><p>　　7-3，未经甲方同意，乙方不能改变租赁房屋的结构装修，乙方不得将承租的房屋转租，并爱护使用租赁的房屋，如因乙方的过失或者过错是房屋设施受到损坏，乙方应负责赔偿。</p><p>　　7-4，乙方应按合同约定合法使用租赁房屋，不得擅自改变使用性质，不得存放危险物品及国家明文规定的不合法之物品，如因此发生损害，乙方应承担全部责任。</p><p>　　八，甲方提供的设备如下(或另附清单说明)：</p><p>　　1，电话</p><p>　　2，淋浴器</p><p>　　3，空调</p><p>　　4，彩电</p><p>　　5，冰箱</p><p>　　6，洗衣机</p><p>　　7，家具</p><p>　　8，其他 。</p><p>　　水，电，煤气表现数字：水表 ，电表 ，煤气表 。</p><p>　　九，押金及违约金</p><p>　　9-1，为确保房屋及其所属设施之安全与完好及租赁期内相关费用之如期结算，甲乙双方同意本合同的押金为：(人民币大写) 万 仟 佰 拾 元整。</p><p>　　9-2，甲，乙双方如有特殊情况需提前终止合同，必须提前一个月通知对方和中介方，待双方同意后，方可办理退房手续。若甲方违约，除退还给乙方保证金外，还需支付给乙方上述金额的违约金，反之，若乙方违约，则甲方有权不退还保证金。</p><p>　　9-3，凡在执行本合同或与本合同有关的事情时双方发生争议，应首先友好协商，协商不成，可向当地人<a href=\"http://www.liuxue86.com/sifa/minfa/\" target=\"_blank\">民法</a>院提起诉讼，中介方协助双方所需见证工作，但不承担任何法律和经济责任。</p><p>　　十，其他条款</p><p>　　10-1，甲乙双方在签署本合同时，具有完全民事行为能力，对各自权利义务责任清楚明白，并按合同规定严格执行如一方违反本合同，另一方有权按合同规定索赔。</p><p>　　10-2，本合同未尽事宜，经双方协商一致，可订立补充条款，本合同及其补充条款和附件设备清单内空格部分填写的文字与打印文字具有同等效力。</p><p>　　10-3，本合同连补充条款及附件共 页，壹式 份。其中，甲乙双方各执 份，中介方壹份，均具有同等效力。签字即生效。</p><p>　　出租方(甲方)： 承租方(乙方)： 中介方：</p><p>　　联系地址： 联系地址： 联系地址：</p><p>　　电话： 电话： 电话：</p><p>　　证件号： 证件号：</p><p>　　产权证号： 代表人/代理人： 经办人：</p><p>　　签约日期： 签约日期： 签约日期：</p><h2>　　重庆市房屋租赁合同(二)</h2><p>　　出租人(以下简称甲方)：</p><p>　　【法定代表人】【负责人】： 国籍：</p><p>　　【身份证】【<a href=\"http://visa.liuxue86.com/huzhaobanli/\" target=\"_blank\">护照</a>】【营业执照注册号】【其他： 】：</p><p>　　通讯地址：</p><p>　　邮政编码： 联系电话： (手机) ;</p><p>　　【代理人】： 国籍：</p><p>　　【身份证】【护照】【营业执照注册号】【其他： 】：</p><p>　　通讯地址：</p><p>　　邮政编码： 联系电话： (手机) ;</p><p>　　承租人(以下简称乙方)：</p><p>　　【法定代表人】【负责人】： 国籍：</p><p>　　【身份证】【护照】【营业执照注册号】【其他： 】：</p><p>　　通讯地址：</p><p>　　邮政编码： 联系电话： (手机) ;</p><p>　　【代理人】： 国籍：</p><p>　　【身份证】【护照】【营业执照注册号】【其他： 】：</p><p>　　通讯地址：</p><p>　　邮政编码： 联系电话： (手机) ;</p><p>　　根据《中华人民共和国<a href=\"http://www.liuxue86.com/hetongfanben/hetongfa/\" target=\"_blank\">合同法</a>》、《中华人民共和国城市房地产管理法》及相关法律、法规的规定，甲乙双方在自愿、平等、公平和诚实信用的基础上，经协商一致，就乙方承租甲方可依法出租的房屋事宜，签订本合同。</p><p>　　一、出租房屋基本情况</p><p>　　(一)房屋坐落：</p><p>　　(二)该房屋权属<a href=\"http://www.liuxue86.com/fanwen/zhengming/\" target=\"_blank\">证明</a>名称：</p><p>　　编号： 。</p><p>　　(三)该房屋建筑面积： 平方米，套内建筑面积： 平方米。</p><p>　　(四)该房屋权属证明记载用途： 。</p><p>　　(五)该房屋现有装修及设施设备情况，由甲、乙双方分别在本合同附件中列明。除双方另有约定外，该附件作为甲方按照本合同约定交付乙方使用和乙方在本合同租赁期满交还该房屋的验证凭据。</p><p>　　二、租赁期限</p><p>　　(一)该房屋租赁期限共 个月，自 年 月 日至 年</p><p>　　月 日止。</p><p>　　(二)租赁期满，甲方有权收回该房屋，乙方应如期交还。乙方需要继续承租该房屋的，则应于租赁期届满前 日通知甲方。</p><p>　　三、租金及支付方式</p><p>　　(一)该房屋租金为： 元/(□月□季□半年□年);本合同期内租金总额为： 元。(大写： )</p><p>　　(二)该房屋租金支付方式：</p><p>　　四、押金及其他费用的约定</p><p>　　(一)甲方交付该房屋时，乙方应向甲方支付房屋租赁押金。押金为 元(大写： )。甲方收取押金后应向乙方出具收款凭证。</p><p>　　(二)租赁期间，使用该房屋所发生的水、电、燃气、通讯费用由 方承担;有线电视、物业管理费用由 方承担。</p><p>　　(三)租赁期内，因该房屋租赁产生的税费按国家法律、法规规定承担。</p><p>　　(四)租赁期满或合同解除后，甲方应退还乙方支付的房屋租赁押金。</p><p>　　(五)其他约定： 。</p><p>　　五、成交方式</p><p>　　甲乙双方系通过以下第 种方式成交。</p><p>　　(一)自行成交。</p><p>　　(二)房地产经纪机构成交。提供服务的房地产经纪机构名称为：</p><p>　　，备案证书号为：</p><p>　　通讯地址：</p><p>　　邮政编码： 联系电话：</p><p>　　提供服务的房地产经纪人员职业资格为</p><p>　　注册证号</p><p>　　六、关<a href=\"http://tool.liuxue86.com/shiren_view_9b85d143ac9b85d1/\" target=\"_blank\">于房</a>屋转租与出售的约定</p><p>　　(一)未经甲方书面同意，乙方不得将房屋转租、转借他人。</p><p>　　(二)租赁期间，甲方出售该房屋的应在出售前 日书面通知乙方，在同等条件下，乙方有优先购买权。</p><p>　　七、关于甲方交房的约定</p><p>　　(一)甲方应于 年 月 日前将房屋按约定条件交付给乙方。《现有装修、附属设施及设备清单》经双方交验签字盖章并移交房门钥匙后视为交付完成。</p><p>　　(二)甲方延迟交房超 日的，乙方有权单方解除合同。乙方要求继续履行合同的,合同继续履行，甲方自约定交房<a href=\"http://www.liuxue86.com/shijian/\" target=\"_blank\">时间</a>之日起至实际交付房屋之日止，向乙方每日按已付租金的 %支付违约金。</p><p>　　八、关于乙方付款的约定</p><p>　　(一)乙方应按本合同第三条的约定向甲方如期支付租金。</p><p>　　(二)乙方未按约定时间支付租金超 日，甲方有权单方解除合同。甲方不解除合同的,乙方应向甲方按应付租金的 %支付违约金。</p><p>　　九、其他约定</p><p>　　(一)租赁期内，甲方应保障该房屋及其附属设施处于正常使用的状态，并承担乙方正常使用下房屋及附属设施损坏或故障的修复义务;甲方不承担房屋的维修义务,致使乙方无法正常使用房屋及附属设施的，乙方有权单方解除合同;对于乙方的装修、改善和增设的他物甲方不承担维修义务。</p><p>　　(二)乙方应合理使用并爱护该房屋及其附属设施。因乙方保管不当或不合理使用，致使该房屋及其附属设施发生损坏或故障的,乙方应负责维修或承担赔偿责任;乙方保管不当或不合理使用导致附属物品、设备设施损坏并拒绝赔偿的，甲方有权单方解除合同。</p><p>　　(三)在租赁期内未征得甲方书面同意以及按规定须经有关部门审批但未核准前，乙方不得擅自改变房屋用途。不得在该房屋内进行违反法律法规及政府对出租房屋用途有关规定的行为。乙方擅自改变房屋用途，甲方有权单方解除合同。</p><p>　　(四)租赁期内，甲方提前收回该房屋或乙方提前退租的，应提前 日通知对方，并按月租金的 %向对方支付违约金，属甲方违约的甲方还应退还相应的租金。</p><p>　　(五)租赁到期或合同解除后，乙方应将房屋钥匙及正常使用状态下的附件中所列物品交还给甲方，乙方应当保证该房屋附属设施、设备、装饰装修保持良好，结清应由乙方支付的相关费用。</p><p>　　(六)甲方保证已如实介绍该房屋权属状况、附属设施设备、装饰装修情况，出租该房屋不违反国家法律法规的相关规定及有权决定此租赁事宜。乙方保证已对上述房地产作充分了解并实地看房，对该房屋现状无异议，愿意租赁该房屋。</p><p>　　(七)经甲、乙双方协商一致，可以解除本合同。</p><p>　　(八)关于租赁期间房屋被征收的约定：</p><p>　　十、登记备案</p><p>　　甲乙双方自本合同签订之日起三十日内，由□甲乙双方共同 □甲方 □乙方按相关规定向房屋所在地房地产行政管理部门申请办理房屋租赁登记备案。</p><p>　　租赁期内，房屋租赁登记备案内容发生变更的，甲乙双方应当在十日内，到原租赁登记备案的部门办理房屋租赁登记备案变更手续。</p><p>　　租赁期满房屋续租或者租赁终止的，由□甲乙双方共同 □甲方 □乙方在期满后三十日内到原租赁登记备案的部门办理房屋租赁登记备案的延续或者注销手续。</p><p>　　十一、争议的解决方式</p><p>　　甲、乙双方在履行本合同过程中发生争议的，应协商解决;协商不成的，可依法选择：□向人民法院起诉 □向重庆仲裁委员会申请仲裁。</p><p>　　十二、补充约定</p><p>　　十三、附则</p><p>　　(一)本合同所列地址为各方准确联系地址，相关<a href=\"http://www.liuxue86.com/wenshuxiezuo/\" target=\"_blank\">文书</a>送达到该地址，即视为送达给其本人。任何一方地址变更，应及时书面通知相关方，否则自行承担相关责任。</p><p>　　(二)本合同一式 份，甲、乙双方各执 份， 、和登记机构各执一份，均具有同等法律效力。本合同经双方签字盖章之日起生效。</p><p>　　出租人： 承租人：</p><p>　　法定代表人(负责人)： 法定代表人(负责人)：</p><p>　　委托代理人： 委托代理人：</p><p>　　签约时间： 年 月 日 签约时间： 年 月 日</p><p>　　签约地点： 签约地点：</p>', '1/zQGKi0MXJDySypdJF9s6qnvbEZ5NPkig.png', '1460358578', '1', '0');
INSERT INTO `qfb_agreement` VALUES ('8', '借款协议', '定期二<h2>重庆市房屋租赁合同(一)</h2><p>　　出租方(以下简称甲方)： 承租方(以下简称乙方)：</p><p>　　根据国家有关法律法规，和本市有关规定，甲，乙双方在自愿，平等，互利的基础上，就甲方将其合法拥有的房屋出租给乙方使用，乙方承租使用甲方房屋事宜订立本合同。</p><p>　　一，房屋的座落面积</p><p>　　1-1，甲方将其合法拥有的座落于北京市 的房屋出租给乙方使用。</p><p>　　1-2，甲方将出租的房屋房型为 室 厅 卫。</p><p>　　1-3，甲方出租给乙方使用的该房屋建筑面积共 平方米。</p><p>　　二，租赁用途</p><p>　　2-1，乙方向甲方承诺租赁该房屋仅作为 使用。</p><p>　　2-2，在租赁期限内，未事前征得甲方的书面同意，乙方不得擅自改变该房屋的使用用途。</p><p>　　三，租赁期限</p><p>　　3-1，该房屋租赁期为 个月，自 年 月 日起，至 年 月 日止。</p><p>　　3-2，租赁期满，甲方有权收回全部出租房屋，乙方应如期交还。乙方如要求续租，则必须在租赁期满前的 个月向甲方提出书面意向，双方可在对租金期限重新协商后，签订新的<a href=\"http://www.liuxue86.com/hetongfanben/zulin/\" target=\"_blank\">租赁合同</a>。</p><p>　　四，租金及支付方式</p><p>　　4-1，该房屋的月租金为人民币： 万 仟 佰 拾 元整，租金以 方式支付。</p><p>　　4-2，双方议定首期付 个月租金，押 个月押金，以后按每 个月结算一次，提前 天支付下次房租，押金不变，甲方在收到乙方租金(包括押金)后必须开具 予乙方。</p><p>　　五，其他<a href=\"http://www.liuxue86.com/feiyong/\" target=\"_blank\">费用</a></p><p>　　5-1，乙方在租赁期内实际使用的水费，电费，煤气费，电话费，有线电视费及 等费用应由乙方自行承担，并按单如期缴纳。</p><p>　　5-2，乙方应把已缴纳过的单据复印件交与甲方。</p><p>　　六，甲方的义务</p><p>　　6-1，甲方需按时将房屋及附属设施交付乙方使用。</p><p>　　6-2，房屋及附属设施如非乙方的过失和错误使用而受到损坏时，甲方有修缮的责任并承担相关的费用。</p><p>　　6-3，甲方应定期对房屋和设施进行维修保养(提前10天<a href=\"http://www.liuxue86.com/tongzhi/\" target=\"_blank\">通知</a>乙方)。</p><p>　　6-4，甲方应保证所出租房屋权属清楚，无共同人意见，无使用之纠纷。</p><p>　　6-5，在甲方将房屋交给乙方使用之前，应负责配备租赁房屋内的装修，灯具，厨房设备等，其所有权归甲方所有。</p><p>　　七，乙方的义务</p><p>　　7-1，乙方在租赁期内保证在该租赁房屋内的所有活动均能合乎中国的法律及该地点管理规定，不作任何违法之行为。</p><p>　　7-2，乙方应按合同的规定，按时支付租金及其他各项费用。</p><p>　　7-3，未经甲方同意，乙方不能改变租赁房屋的结构装修，乙方不得将承租的房屋转租，并爱护使用租赁的房屋，如因乙方的过失或者过错是房屋设施受到损坏，乙方应负责赔偿。</p><p>　　7-4，乙方应按合同约定合法使用租赁房屋，不得擅自改变使用性质，不得存放危险物品及国家明文规定的不合法之物品，如因此发生损害，乙方应承担全部责任。</p><p>　　八，甲方提供的设备如下(或另附清单说明)：</p><p>　　1，电话</p><p>　　2，淋浴器</p><p>　　3，空调</p><p>　　4，彩电</p><p>　　5，冰箱</p><p>　　6，洗衣机</p><p>　　7，家具</p><p>　　8，其他 。</p><p>　　水，电，煤气表现数字：水表 ，电表 ，煤气表 。</p><p>　　九，押金及违约金</p><p>　　9-1，为确保房屋及其所属设施之安全与完好及租赁期内相关费用之如期结算，甲乙双方同意本合同的押金为：(人民币大写) 万 仟 佰 拾 元整。</p><p>　　9-2，甲，乙双方如有特殊情况需提前终止合同，必须提前一个月通知对方和中介方，待双方同意后，方可办理退房手续。若甲方违约，除退还给乙方保证金外，还需支付给乙方上述金额的违约金，反之，若乙方违约，则甲方有权不退还保证金。</p><p>　　9-3，凡在执行本合同或与本合同有关的事情时双方发生争议，应首先友好协商，协商不成，可向当地人<a href=\"http://www.liuxue86.com/sifa/minfa/\" target=\"_blank\">民法</a>院提起诉讼，中介方协助双方所需见证工作，但不承担任何法律和经济责任。</p><p>　　十，其他条款</p><p>　　10-1，甲乙双方在签署本合同时，具有完全民事行为能力，对各自权利义务责任清楚明白，并按合同规定严格执行如一方违反本合同，另一方有权按合同规定索赔。</p><p>　　10-2，本合同未尽事宜，经双方协商一致，可订立补充条款，本合同及其补充条款和附件设备清单内空格部分填写的文字与打印文字具有同等效力。</p><p>　　10-3，本合同连补充条款及附件共 页，壹式 份。其中，甲乙双方各执 份，中介方壹份，均具有同等效力。签字即生效。</p><p>　　出租方(甲方)： 承租方(乙方)： 中介方：</p><p>　　联系地址： 联系地址： 联系地址：</p><p>　　电话： 电话： 电话：</p><p>　　证件号： 证件号：</p><p>　　产权证号： 代表人/代理人： 经办人：</p><p>　　签约日期： 签约日期： 签约日期：</p><h2>　　重庆市房屋租赁合同(二)</h2><p>　　出租人(以下简称甲方)：</p><p>　　【法定代表人】【负责人】： 国籍：</p><p>　　【身份证】【<a href=\"http://visa.liuxue86.com/huzhaobanli/\" target=\"_blank\">护照</a>】【营业执照注册号】【其他： 】：</p><p>　　通讯地址：</p><p>　　邮政编码： 联系电话： (手机) ;</p><p>　　【代理人】： 国籍：</p><p>　　【身份证】【护照】【营业执照注册号】【其他： 】：</p><p>　　通讯地址：</p><p>　　邮政编码： 联系电话： (手机) ;</p><p>　　承租人(以下简称乙方)：</p><p>　　【法定代表人】【负责人】： 国籍：</p><p>　　【身份证】【护照】【营业执照注册号】【其他： 】：</p><p>　　通讯地址：</p><p>　　邮政编码： 联系电话： (手机) ;</p><p>　　【代理人】： 国籍：</p><p>　　【身份证】【护照】【营业执照注册号】【其他： 】：</p><p>　　通讯地址：</p><p>　　邮政编码： 联系电话： (手机) ;</p><p>　　根据《中华人民共和国<a href=\"http://www.liuxue86.com/hetongfanben/hetongfa/\" target=\"_blank\">合同法</a>》、《中华人民共和国城市房地产管理法》及相关法律、法规的规定，甲乙双方在自愿、平等、公平和诚实信用的基础上，经协商一致，就乙方承租甲方可依法出租的房屋事宜，签订本合同。</p><p>　　一、出租房屋基本情况</p><p>　　(一)房屋坐落：</p><p>　　(二)该房屋权属<a href=\"http://www.liuxue86.com/fanwen/zhengming/\" target=\"_blank\">证明</a>名称：</p><p>　　编号： 。</p><p>　　(三)该房屋建筑面积： 平方米，套内建筑面积： 平方米。</p><p>　　(四)该房屋权属证明记载用途： 。</p><p>　　(五)该房屋现有装修及设施设备情况，由甲、乙双方分别在本合同附件中列明。除双方另有约定外，该附件作为甲方按照本合同约定交付乙方使用和乙方在本合同租赁期满交还该房屋的验证凭据。</p><p>　　二、租赁期限</p><p>　　(一)该房屋租赁期限共 个月，自 年 月 日至 年</p><p>　　月 日止。</p><p>　　(二)租赁期满，甲方有权收回该房屋，乙方应如期交还。乙方需要继续承租该房屋的，则应于租赁期届满前 日通知甲方。</p><p>　　三、租金及支付方式</p><p>　　(一)该房屋租金为： 元/(□月□季□半年□年);本合同期内租金总额为： 元。(大写： )</p><p>　　(二)该房屋租金支付方式：</p><p>　　四、押金及其他费用的约定</p><p>　　(一)甲方交付该房屋时，乙方应向甲方支付房屋租赁押金。押金为 元(大写： )。甲方收取押金后应向乙方出具收款凭证。</p><p>　　(二)租赁期间，使用该房屋所发生的水、电、燃气、通讯费用由 方承担;有线电视、物业管理费用由 方承担。</p><p>　　(三)租赁期内，因该房屋租赁产生的税费按国家法律、法规规定承担。</p><p>　　(四)租赁期满或合同解除后，甲方应退还乙方支付的房屋租赁押金。</p><p>　　(五)其他约定： 。</p><p>　　五、成交方式</p><p>　　甲乙双方系通过以下第 种方式成交。</p><p>　　(一)自行成交。</p><p>　　(二)房地产经纪机构成交。提供服务的房地产经纪机构名称为：</p><p>　　，备案证书号为：</p><p>　　通讯地址：</p><p>　　邮政编码： 联系电话：</p><p>　　提供服务的房地产经纪人员职业资格为</p><p>　　注册证号</p><p>　　六、关<a href=\"http://tool.liuxue86.com/shiren_view_9b85d143ac9b85d1/\" target=\"_blank\">于房</a>屋转租与出售的约定</p><p>　　(一)未经甲方书面同意，乙方不得将房屋转租、转借他人。</p><p>　　(二)租赁期间，甲方出售该房屋的应在出售前 日书面通知乙方，在同等条件下，乙方有优先购买权。</p><p>　　七、关于甲方交房的约定</p><p>　　(一)甲方应于 年 月 日前将房屋按约定条件交付给乙方。《现有装修、附属设施及设备清单》经双方交验签字盖章并移交房门钥匙后视为交付完成。</p><p>　　(二)甲方延迟交房超 日的，乙方有权单方解除合同。乙方要求继续履行合同的,合同继续履行，甲方自约定交房<a href=\"http://www.liuxue86.com/shijian/\" target=\"_blank\">时间</a>之日起至实际交付房屋之日止，向乙方每日按已付租金的 %支付违约金。</p><p>　　八、关于乙方付款的约定</p><p>　　(一)乙方应按本合同第三条的约定向甲方如期支付租金。</p><p>　　(二)乙方未按约定时间支付租金超 日，甲方有权单方解除合同。甲方不解除合同的,乙方应向甲方按应付租金的 %支付违约金。</p><p>　　九、其他约定</p><p>　　(一)租赁期内，甲方应保障该房屋及其附属设施处于正常使用的状态，并承担乙方正常使用下房屋及附属设施损坏或故障的修复义务;甲方不承担房屋的维修义务,致使乙方无法正常使用房屋及附属设施的，乙方有权单方解除合同;对于乙方的装修、改善和增设的他物甲方不承担维修义务。</p><p>　　(二)乙方应合理使用并爱护该房屋及其附属设施。因乙方保管不当或不合理使用，致使该房屋及其附属设施发生损坏或故障的,乙方应负责维修或承担赔偿责任;乙方保管不当或不合理使用导致附属物品、设备设施损坏并拒绝赔偿的，甲方有权单方解除合同。</p><p>　　(三)在租赁期内未征得甲方书面同意以及按规定须经有关部门审批但未核准前，乙方不得擅自改变房屋用途。不得在该房屋内进行违反法律法规及政府对出租房屋用途有关规定的行为。乙方擅自改变房屋用途，甲方有权单方解除合同。</p><p>　　(四)租赁期内，甲方提前收回该房屋或乙方提前退租的，应提前 日通知对方，并按月租金的 %向对方支付违约金，属甲方违约的甲方还应退还相应的租金。</p><p>　　(五)租赁到期或合同解除后，乙方应将房屋钥匙及正常使用状态下的附件中所列物品交还给甲方，乙方应当保证该房屋附属设施、设备、装饰装修保持良好，结清应由乙方支付的相关费用。</p><p>　　(六)甲方保证已如实介绍该房屋权属状况、附属设施设备、装饰装修情况，出租该房屋不违反国家法律法规的相关规定及有权决定此租赁事宜。乙方保证已对上述房地产作充分了解并实地看房，对该房屋现状无异议，愿意租赁该房屋。</p><p>　　(七)经甲、乙双方协商一致，可以解除本合同。</p><p>　　(八)关于租赁期间房屋被征收的约定：</p><p>　　十、登记备案</p><p>　　甲乙双方自本合同签订之日起三十日内，由□甲乙双方共同 □甲方 □乙方按相关规定向房屋所在地房地产行政管理部门申请办理房屋租赁登记备案。</p><p>　　租赁期内，房屋租赁登记备案内容发生变更的，甲乙双方应当在十日内，到原租赁登记备案的部门办理房屋租赁登记备案变更手续。</p><p>　　租赁期满房屋续租或者租赁终止的，由□甲乙双方共同 □甲方 □乙方在期满后三十日内到原租赁登记备案的部门办理房屋租赁登记备案的延续或者注销手续。</p><p>　　十一、争议的解决方式</p><p>　　甲、乙双方在履行本合同过程中发生争议的，应协商解决;协商不成的，可依法选择：□向人民法院起诉 □向重庆仲裁委员会申请仲裁。</p><p>　　十二、补充约定</p><p>　　十三、附则</p><p>　　(一)本合同所列地址为各方准确联系地址，相关<a href=\"http://www.liuxue86.com/wenshuxiezuo/\" target=\"_blank\">文书</a>送达到该地址，即视为送达给其本人。任何一方地址变更，应及时书面通知相关方，否则自行承担相关责任。</p><p>　　(二)本合同一式 份，甲、乙双方各执 份， 、和登记机构各执一份，均具有同等法律效力。本合同经双方签字盖章之日起生效。</p><p>　　出租人： 承租人：</p><p>　　法定代表人(负责人)： 法定代表人(负责人)：</p><p>　　委托代理人： 委托代理人：</p><p>　　签约时间： 年 月 日 签约时间： 年 月 日</p><p>　　签约地点： 签约地点：</p>', '1/ccg_VYB8IQ_035eXl6-P-cNlPo9Z-zRm.png', '1460439616', '2', '0');
INSERT INTO `qfb_agreement` VALUES ('9', '定期3', '定期3<p><strong>【个人租房合同简单范本(一)】</strong></p><p>　　出租方(甲方)：</p><p>　　承租方(乙方)：</p><p>　　根据《中华人民共和国<a href=\"http://www.liuxue86.com/hetongfanben/hetongfa/\" target=\"_blank\">合同法</a>》及相关法律法规的规定。甲乙双方在平等自愿基础上，就甲方将房屋出租给乙方使用，乙方承租甲方房屋事宜，为明确双方权利义务，经协商一致，订立本合同。</p><p>　　第一条房屋座落：**县新新小区二号楼五单元101室，包括101号地下室。</p><p>　　房屋拥有设施：上水管、下水道、瓷脸盆、座便器、洗脸盆、防盗网、暖气片、防盗门。</p><p>　　第二条房屋租期为壹年。从年月日至年月日。</p><p>　　乙方租赁该房屋仅作为日常家庭居住使用。</p><p>　　租赁期满，甲方有权收回此出租的房屋，乙方应如期归还。乙方要求续租，则必须在租赁期满日三个月前书面<a href=\"http://www.liuxue86.com/tongzhi/\" target=\"_blank\">通知</a>甲方。经甲方同意后，乙方在交清第二年全年租金的同时，重新签订<a href=\"http://www.liuxue86.com/hetongfanben/zulin/\" target=\"_blank\">租赁合同</a>。在同等条件下，<a href=\"http://www.liuxue86.com/hetongfanben/fangwuzulinghetong/\">精彩房屋合同请上出国留学网合同栏目 http://www.liuxue86.com/hetongfanben/fangwuzulinghetong/</a> 乙方享有优先承租权。</p><p>　　第三条本合同的租金交付方式为现金，先付后用。乙方一次向甲方交足全年租金元，租金交付日为本合同签字日和生效日。</p><p>　　第四条在租用期间，乙方由于各种消费行为所发生的电费、水费、物业费、取暖费、有线电视收视费以及应由自己负责的其他<a href=\"http://www.liuxue86.com/feiyong/\" target=\"_blank\">费用</a>，由乙方自行负担。</p><p>　　第五条甲乙双方的权利和责任：</p><p>　　(一)甲乙双方在合同存续期间均无权单方终止履行合同。应由双方协商一致后再行解决。协商不成时，不影响合同的执行(本条第三款情况除外)。</p><p>　　(二)乙方在居住期间应维护好房屋结构、设备、物品和门窗的完整。如有所损坏，需在合同期满日之前恢复原貌，由此所发生的费用由乙方负担。</p><p>　　(三)乙方在租住期间不得把此房屋转借、转租给他人使用。不得改变租赁用途或利用此房屋进行违法犯罪等性质的活动。不得改变房屋结构和损坏房屋。遇有上述情况，甲方有权单方终止合同的执行，且不退还乙方向甲方已缴纳的租金，乙方给甲方所造成的损失由乙方承担赔偿。</p><p>　　第六条本合同未尽事宜，由双方协商解决。</p><p>　　本合同共两页，一式两份，由甲、乙双方各持一份</p><p>　　甲方(签字)：乙方(签字)：</p><p>　　年月日年月日</p><p>　　住址：原住址：</p><p>　　工作单位：工作单位：</p><p>　　电话：电话：</p><p>　　手机：手机：</p><p><strong>　　【个人租房合同简单范本(二)】</strong></p><p>　　出租方(以下简称甲方)：</p><p>　　承租方(以下简称乙方)：</p><p>　　甲、乙双方就下列房屋的租赁达成如下协议：</p><p>　　第一条房屋基本情况。</p><p>　　甲方房屋(以下简称该房屋)将坐落于长白路渤海小区9号楼1单元102室;</p><p>　　共6层第1层。</p><p>　　第二条租赁期限。</p><p>　　租赁期限自2015年8月19日至2016年8月19日止。</p><p>　　第四条租金。个人<a href=\"http://www.liuxue86.com/hetongfanben/hetongshu/zufang/\" target=\"_blank\">租房合同书</a>该房屋月租金为(人民币大写)千百拾元整。</p><p>　　租赁期间，如遇到国家有关政策调整，则按新政策规定调整租金标准;除此之外，出租方不得以任何理由任意调整租金。</p><p>　　第五条付款方式。</p><p>　　乙方按一次性支付租金给甲方。</p><p>　　第六条交付房屋期限。</p><p>　　甲方应于本合同生效之日起一日内，将该房屋交付给乙方。</p><p>　　第七条房屋出租用途</p><p>　　房子出租后，乙方只能用于居住，不得用来经营。如若用于经营，则必须另行商议租金。如若有违，甲方有权收回房屋，不退还租金。</p><p>　　第八条维修养护责任。</p><p>　　因乙方管理使用不善造成房屋及其相连设备的损失和维修费用，由乙方承担并责任赔偿损失。</p><p>　　第九条关<a href=\"http://tool.liuxue86.com/shiren_view_9b85d143ac9b85d1/\" target=\"_blank\">于房</a>屋租赁期间的有关费用。</p><p>　　在房屋租赁期间，以下费用由乙方支付：</p><p>　　1.水、电费;</p><p>　　2.煤气费;</p><p>　　以下费用由甲方支付：</p><p>　　1.供暖费;</p><p>　　2.物业管理费;</p><p>　　第十条房屋押金</p><p>　　甲、乙双方自本合同签订之日起，由乙方支付甲方作为押金。</p><p>　　本合同及其附件和补充协议中未规定的事项，均遵照中华人民共和国有关法律、法规和政策执行。</p><p>　　甲方(签字)：_____乙方(签字)：_____</p><p>　　电话： 电话：</p><p>　　___年___月___日___年___月___日</p><p><strong>　　【个人租房合同简单范本(三)】</strong></p><p>　　出租方(以下简称甲方)：姓名： 身份证： 承租方(以下简称乙方)：姓名： 身份证： 甲、乙双方就下列房屋的租赁达成如下协议：</p><p>　　第一条 房屋基本情况。</p><p>　　甲方房屋(以下简称该房屋)坐落于;共层 第层。</p><p>　　第二条 房屋用途。</p><p>　　该房屋用途为租赁住房。</p><p>　　除双方另有约定外，乙方不得任意改变房屋用途。</p><p>　　第三条 租赁期限。</p><p>　　租赁期限自___年___月___日至___年___月___日止。</p><p>　　第四条 租金。</p><p>　　该房屋年租金为(人民币大写) 千 百 拾元整( 元)。</p><p>　　第五条 付款方式。</p><p>　　乙方按年支付租金给甲方。并于合同签订之日交付。</p><p>　　第六条 交付房屋期限。</p><p>　　甲方签订合同之日，将该房屋交付给乙方。</p><p>　　第七条 甲方对房屋产权的承诺。</p><p>　　甲方保证拥有房屋产权，提供相应<a href=\"http://www.liuxue86.com/fanwen/zhengming/\" target=\"_blank\">证明</a>。在交易时该房屋没有产权纠纷;除补充协议另有约定外，有关按揭、抵押债务、税项及租金等，甲方均在交付房屋前办妥。交易后如有上述未清事项，由甲方承担全部责任，由此给乙方造成经济损失的，由甲方负责赔偿。</p><p>　　第八条 维修养护责任。</p><p>　　正常的房屋大修理费用由甲方承担;日常的房屋维修费用由乙方承担。</p><p>　　因乙方管理使用不善造成房屋及其相连设备的损失和维修费用，由乙方承担并责任赔偿损失。</p><p>　　租赁期间，防火安全，门前三包，综合治理及安全、保卫等工作，乙方应执行当地有关部门规定并承担全部责任和服从甲方监督检查。</p><p>　　第九条 关于房屋租赁期间的有关费用。</p><p>　　在房屋租赁期间，以下费用由乙方支付：</p><p>　　1.水费、电费、生活垃圾费;</p><p>　　2.物业管理费;</p><p>　　第十条 房屋押金</p><p>　　甲、乙双方自本合同签订之日起，由乙方支付甲方 ( 大写) 作为押金。以收据为证。</p><p>　　第十一条 租赁期满。</p><p>　　1、租赁期满后，如乙方要求继续租赁，甲方则优先同意继续租赁;并延用本合同。</p><p>　　2、租赁期满后，如甲方未明确表示不续租的，则视为同意乙方继续承租;并延用本合同。</p><p>　　3、如甲或乙方要求停止租赁，则应提前一月告知对方。</p><p>　　第十二条 违约责任。</p><p>　　租赁期间双方必须信守合同，任何一方违反本合同的规定，按年度须向对方交纳三个月租金作为违约金。</p><p>　　第十三条 因不可抗力原因导致该房屋毁损和造成损失的，双方互不承担责任。 第十四条 本合同未尽事项，由甲、乙双方另行议定，并签订补充协议。补充协议与本合同不一致的，以补充协议为准。</p><p>　　本合同和补充协议中未规定的事项，均遵照中华人民共和国有关法律、法规和政策执行。</p><p>　　第十五条 其他约定</p><p>　　(一)出租方为已提供物品如下：</p><p>　　(1)</p><p>　　(2)</p><p>　　(3)</p><p>　　(4)</p>', '1/rEHRcA9aeougDxcJUkoSgekvHRSPwFob.png', '1460700986', '2', '0');
INSERT INTO `qfb_agreement` VALUES ('4', '用户转移协议', '<p>用户转移协议</p><p>钱富宝用户转移</p>', '1/9v7OMEFn8REQVT4KiNO0CObDtkbCOAyT.png', '1461209764', '0', '0');
INSERT INTO `qfb_agreement` VALUES ('12', '产品详情', '<p>借款方信息</p><p>背景：个人</p><p>借款用途：资金周转</p><p>姓名：王**</p><p>所在地：湖南省</p><p>性别：男</p><p>年龄：18</p><p>证件号码：430921********4</p><p><br></p><p><img src=\"http://imgs.qianfb.com/uploads/1/I9Zh_yEemQVmOivaG4H1c0bVb0TV0iDh.png\"></p><p>风控措施</p><p>1、原借款人已将车辆办理质押手续。</p><p>2、提供连带担保责任。</p><p>3、融资人已签《债权回购协议》，债权到期时将溢价回购。</p><p><br></p><p>资质认证</p><p>包括不限于提供企业营业执照、借款人身份证，房产证、公证书、车辆登记证、行驶证、 人车合照的扫描件。</p><p><br></p><p><img src=\"http://imgs.qianfb.com/uploads/1/rKEJ60q5wbj8nr6ORqIOX5ycqzuK5jzG.png\"></p>', '1/J6Jjp2AHAtiJcSwIn_JzjI_v0044Vol3.png', '1492137375', '2', '0');
INSERT INTO `qfb_agreement` VALUES ('13', 'yinhang1', '<p>1</p>', '1/uHVvPQNXlYnV91C1AeDqrwBaUhnZWijd.png', '1499241916', '0', '0');
INSERT INTO `qfb_article` VALUES ('10', '理财转入说明', '1442916058', '<div id=\"container\" style=\"font-size: 14px;\">\r\n<div style=\"width: 100%; max-width: 980px; box-sizing: border-box; display: table; margin: 0 auto; padding: 0 12px 20px 12px; color: #333; font-family: \'Microsoft Yahei\', Helvetica, Arial, sans-serif;\">\r\n<div style=\"margin-top: 14px;\">\r\n<div id=\"title\" style=\"font-size: 18px; color: #2c5e99; font-weight: bold; margin-bottom: 10px;\">支持银行卡及限额、次数</div>\r\n<table id=\"container2\" style=\"font-size: 14px; border: 1px #CBCBCB solid;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr style=\"height: 40px; text-align: center; background: #EDF8FE; font-weight: bold;\">\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">银行</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">单笔限额</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">单日限额</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">交易次数（月）</td>\r\n</tr>\r\n<tr style=\"height: 40px; text-align: center;\">\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">中国工商银行</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">5万</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">5万</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">30次</td>\r\n</tr>\r\n<tr style=\"height: 40px; text-align: center;\">\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">中国银行</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">1万</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">1万</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">30次</td>\r\n</tr>\r\n<tr style=\"height: 40px; text-align: center;\">\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">中国建设银行</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">50万</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">50万</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">30次</td>\r\n</tr>\r\n<tr style=\"height: 40px; text-align: center;\">\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">兴业银行</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">2万</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">5万</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">不限</td>\r\n</tr>\r\n<tr style=\"height: 40px; text-align: center;\">\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">平安银行</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">50万</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">50万</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">不限</td>\r\n</tr>\r\n<tr style=\"height: 40px; text-align: center;\">\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">中信银行</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">100万</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">100万</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">不限</td>\r\n</tr>\r\n<tr style=\"height: 40px; text-align: center;\">\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">广州农商行</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">100万</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">100万</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">不限</td>\r\n</tr>\r\n<tr style=\"height: 40px; text-align: center;\">\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">广州银行</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">50万</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">50万</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">30次</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div id=\"tit\" style=\"font-size: 18px; margin-top: 16px;\">备注：</div>\r\n<p>1、邮政储蓄银行晚上21点至24点不接受交易。</p>\r\n<p>2、若支付时提示限额小于本上表中的限额，可致电发卡行咨询提升卡片在线支付额度。</p>\r\n<p>3、本说明适用于V1.3.0以上版本。</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n<script>\r\nvar width=window.screen.availWidth;\r\n\r\nif(width<480)\r\n{\r\n	document.getElementById(\"container\").style.fontSize = \"35pt\";\r\n        document.getElementById(\"container2\").style.fontSize = \"35pt\";\r\n        document.getElementById(\"title\").style.fontSize = \"40pt\";\r\n        document.getElementById(\"tit\").style.fontSize = \"40pt\";\r\n}\r\n</script>', '1', '1448355630', '1');
INSERT INTO `qfb_article` VALUES ('9', '常见问题', '1442915928', '<div id=\"container\">\r\n<p><b style=\"color:#2C5E99;\">一、钱富宝</b>\r\n<br /><br />\r\n钱富宝是钱富宝钱包的活期理财产品，七日年化收益率高达12%，随存随取，安全便捷。\r\n<br /><br />\r\n<p><b style=\"color:#2C5E99;\">1.1 如何转入钱富宝理财？</b>\r\n<br /><br />\r\n在首页(钱包)点击“钱富宝”进入钱富宝理财页面，点击右下角“转入”按钮，选择支付方式（目前支持零钱和您绑定的储蓄银行卡），输入充值金额，输入支付密码即可转入钱富宝理财。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">1.2 钱富宝何时能看到收益？</b>\r\n<br /><br />\r\n钱富宝每日（T）24:00前的账户余额，第二日（T+1）开始计算收益，第三日（T+2）即可看到前一日收益。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">1.3 钱富宝收益如何计算？</b>\r\n<br /><br />\r\n钱富宝理财目前7日年化收益率为12%，每日结算收益，且以日复利计算，即每日收益=钱富宝账户资金*12%/365。按当前12%的预期年化收益率来算，万份收益高达3.28元。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">1.4 怎样查看钱富宝的历史收益？</b>\r\n<br /><br />\r\n在首页(钱包)点击“钱富宝”进入钱富宝理财页面，点击右上角“理财明细”即可查看钱富宝理财的转入、转出、收益及消费的明细。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">1.5 钱富宝转入支持哪些方式？</b>\r\n<br /><br />\r\n目前支持银行卡、支付宝、零钱转入。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">1.6 钱富宝转出支持哪些方式？</b>\r\n<br /><br />\r\n目前暂支持转出到银行卡，不可以转出到零钱。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">1.7 转入钱富宝要收取手续费吗？</b>\r\n<br /><br />\r\n不收取任何手续费。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">1.8钱富宝的钱什么时候可以转出？</b>\r\n<br /><br />\r\n工作日（除法定节假日）均支持转出。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">1.9 钱富宝转出到银行卡何时到账？</b>\r\n<br /><br />\r\n（1）工作日14:00前申请转出，则在当日到账；\r\n<br />\r\n（2）工作日14:00后申请转出，则在第二个工作日（T+1）23:59:59之前到账。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">1.10 钱富宝转出金额有限制吗？</b>\r\n<br /><br />\r\n目前所有银行卡单笔转出限额5万，单日转出限额5万。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">1.11 钱富宝转出要收手续费吗？</b>\r\n<br /><br />\r\n单笔转出金额大于等于100元，免手续费；单笔转出少于100元将收取2元/笔的手续费。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">二、赢华智享</b>\r\n<br /><br />\r\n赢华智享是钱富宝里的定期理财项目，分为四档。理财周期30天项目，预期年化收益率是18%；理财周期90天项目，预期年化收益率是20%；理财周期180天项目，预期年化收益率是22%；理财周期365天项目，预期年化收益率是24%。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">2.1定期项目怎么进行收益结算？</b>\r\n<br /><br />\r\n每笔资金，自申购当日开始计息，赎回申请日前一天结束计息（赎回当日不计息）按日结算收益，到期后一次性还本付息。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">2.2在申购周期内可以提前赎回吗？</b>\r\n<br /><br />\r\n申购定期理财项目后，第一个理财周期内不能提前赎回，到期后自动投入第二个理财周期，可以随时赎回，第二个理财周期未到期申请赎回的，第二个理财周期的理财天数不计算收益。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">2.3赎回有什么规则吗，什么时候到帐？</b>\r\n<br /><br />\r\n到期后可以赎回，支持全额或者部分赎回，不限赎回次数。T+2日到达账户余额。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">2.4怎么查看我的定期收益？</b>\r\n<br /><br />\r\n点击进入赢华智享，再点击右上角我的定期理财，可以看到理财总额，预期的定期收益和推荐其他人理财发放的奖励。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">2.5定期项目有没有申购额度的上限和下限？</b>\r\n<br /><br />\r\n全部定期理财项目最低申请一份，每份是1000元，单笔最多可买入1000份。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">三、零钱</b>\r\n<br /><br />\r\n零钱是钱富宝钱包的账户资产，您可进行零钱充值或提现。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">3.1 零钱的用途？</b>\r\n<br /><br />\r\n零钱可用于购买钱富宝理财产品。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">3.2 怎样查看零钱的收支明细？</b>\r\n<br /><br />\r\n在首页(钱包)点击“零钱”进入零钱页面，点击右上角“零钱明细”即可查看零钱的收支明细，包括转入，转出，充值和推荐好友的收益等。。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">3.3 怎样给零钱充值？</b>\r\n<br /><br />\r\n在首页(钱包)点击“零钱”进入零钱页面，点击充值“充值”按钮，输入充值金额，目前可以通过支付宝进行支付，输入支付宝支付密码即可进行充值零钱。。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">3.4 什么时候可以申请零钱提现？</b>\r\n<br /><br />\r\n工作日（除法定节假日）均支持零钱提现申请。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">3.5 零钱提现何时到账？</b>\r\n<br /><br />\r\n（1）工作日14:00前申请提现，则在当日到账；\r\n<br />\r\n（2）工作日14:00后申请提现，则在第二个工作日（T+1）23:59:59之前到账。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">3.6 零钱提现金额有限制吗？</b>\r\n<br /><br />\r\n目前所有银行卡单笔提现限额1万，单日提现限额1万。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">3.7 零钱提现要收手续费吗？</b>\r\n<br /><br />\r\n单笔提现金额大于等于100元，免手续费；单笔提现少于100元将收取2元/笔的手续费。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">四、账户安全</b>\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">4.1 钱富宝怎样保证资金安全？</b>\r\n<br /><br />\r\n（1）钱富宝由赢华-钱富宝智享专项基金提供收益保障；\r\n<br />\r\n（2）账户资金安全由太平洋保险100%承保。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">4.2 支付密码有什么用？</b>\r\n<br /><br />\r\n支付密码是为保证用户资金安全而设立密码体系，所有涉及资金安全的操作（包括零钱充值提现、转入转出钱富宝等），系统都需要校验支付密码。支付密码非常重要，切勿将支付密码告知他人并妥善保管。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">4.3 如何修改支付密码？</b>\r\n<br /><br />\r\n首页点击左上角头像进入“我的信息”页面，点击修改支付密码进入修改支付密码页面进行修改。如果记得原支付密码，需输入并验证原支付密码，验证成功后再输入并确认新支付密码即可；如果忘记了支付密码，则需要输入本人认证的身份证号、注册手机短信验证码进行验证，验证成功后再输入并确认新支付密码。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">4.4 为什么要进行实名认证？</b>\r\n<br /><br />\r\n为确保用户的资金安全，用户在注册时需要完成个人身份信息的验证。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">4.5 为什么绑定银行卡要输入银行卡密码？</b>\r\n<br /><br />\r\n根据人民银行相关规定，第三方支付对用户进行身份核实需要通过五个不同的身份基本信息完成多重交叉验证，包括：姓名、身份证号码、银行卡号、预留手机号码、及银联密码。钱富宝用户身份验证及绑定银行卡通过第三方支付平台“易联支付”（银联战略合作伙伴）完成，用户填入的相关信息只作身份验之用，钱富宝并不能获取也无法留存这些信息，输入银行卡密码时通过经由银联安全认证的专业密码键盘进行输入，手机里任何其他第三方软件都无法获取您输入的密码，您可放心使用。注：银行卡密码连续输错两次后，当天会被锁定，第二天自动恢复。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">4.6 为什么只能绑定一张储蓄卡？</b>\r\n<br /><br />\r\n为了保障您的资金安全，根据人民银行相关规定，钱富宝将实行理财资金同卡进出，因此每位用户只能绑定一张储蓄卡，此卡将作为您理财资金转入转出的唯一途径。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">4.7 可以更换银行卡吗？</b>\r\n<br /><br />\r\n在APP端一旦绑定不可以自动操作换卡。如要解除绑定或者更换银行卡请联系客服进行申请，同时提交注册账号、身份证正反面照片、手持身份证照片、手写解绑申请书，绑定的银行卡号。\r\n<br /><br />\r\n备注：本说明适用于V1.3.0以上版本。\r\n</p>\r\n<script>\r\nvar width=window.screen.availWidth;\r\nif(width<480)\r\n{\r\n	document.getElementById(\"container\").style.fontSize = \"35pt\";\r\n}\r\n</script>', '1', '1443082636', '1');
INSERT INTO `qfb_article` VALUES ('11', '理财转出说明', '1442916137', '<div id=\"container\">\r\n<p><b style=\"color:#2C5E99;\">一、转出限额</b>\r\n<br /><br />\r\n单笔5万，单日5万\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">二、到账时间</b>\r\n<br /><br />\r\n工作日14:00前申请转出，则在当日到账；\r\n<br />\r\n工作日14:00后申请转出，则在第二个工作日（T+1）23:59:59之前到账。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">三、支持银行卡</b>\r\n<br /><br />\r\n钱富宝支持以下银行储蓄卡：工商银行、中国银行、建设银行、邮政储蓄银行、招商银行、兴业银行、光大银行、广发银行、民生银行、平安银行、华夏银行、中信银行、浦东发展银行、广州农商银行、广州银行。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">四、提现手续费</b>\r\n<br /><br />\r\n单笔转出金额大于等于100元，免手续费；\r\n<br />\r\n单笔转出少于100元将收取2元/笔的手续费。\r\n<br /><br />\r\n备注：本说明适用于V1.3.0以上版本。\r\n</p>\r\n</div>\r\n<script>\r\nvar width=window.screen.availWidth;\r\nif(width<480)\r\n{\r\n	document.getElementById(\"container\").style.fontSize = \"35pt\";\r\n}\r\n</script>', '1', '1443147324', '1');
INSERT INTO `qfb_article` VALUES ('15', '申购说明', '1447482949', '<div id=\"container\" style=\"font-size: 14px;\">\r\n<div style=\"width: 100%; max-width: 980px; box-sizing: border-box; display: table; margin: 0 auto; padding: 0 12px 20px 12px; color: #333; font-family: \'Microsoft Yahei\', Helvetica, Arial, sans-serif;\">\r\n<div style=\"margin-top: 14px;\">\r\n<div id=\"title\" style=\"font-size: 18px; color: #2c5e99; font-weight: bold; margin-bottom: 10px;\">支持银行卡及限额、次数</div>\r\n<table id=\"container2\" style=\"font-size: 14px; border: 1px #CBCBCB solid;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr style=\"height: 40px; text-align: center; background: #EDF8FE; font-weight: bold;\">\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">银行</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">单笔限额</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">单日限额</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">交易次数（月）</td>\r\n</tr>\r\n<tr style=\"height: 40px; text-align: center;\">\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">中国工商银行</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">5万</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">5万</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">30次</td>\r\n</tr>\r\n<tr style=\"height: 40px; text-align: center;\">\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">中国银行</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">1万</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">1万</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">30次</td>\r\n</tr>\r\n<tr style=\"height: 40px; text-align: center;\">\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">中国建设银行</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">50万</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">50万</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">30次</td>\r\n</tr>\r\n<tr style=\"height: 40px; text-align: center;\">\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">兴业银行</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">2万</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">5万</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">不限</td>\r\n</tr>\r\n<tr style=\"height: 40px; text-align: center;\">\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">平安银行</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">50万</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">50万</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">不限</td>\r\n</tr>\r\n<tr style=\"height: 40px; text-align: center;\">\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">中信银行</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">100万</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">100万</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">不限</td>\r\n</tr>\r\n<tr style=\"height: 40px; text-align: center;\">\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">广州农商行</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">100万</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">100万</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">不限</td>\r\n</tr>\r\n<tr style=\"height: 40px; text-align: center;\">\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 0; width: 25%;\">广州银行</td>\r\n<td style=\"border-bottom: 1px #CFCFCF solid; border-left: 1px #CFCFCF solid; text-align: center; padding: 12px 