INSERT INTO `qfb_article` VALUES ('12', '版本说明', '1442916576', '<div id=\"container\">\r\n<p><div style=\"text-align:center;\">钱富宝V1.2.0版本说明</div><br />\r\n<b style=\"color:#2C5E99;\">1.新增手机充值，尽享便捷生活</b><br /><br />\r\n<img src=\"http://img.dm188.cn/dlb/upload/brand/201509/dfcd3f354d1ddc6e6ad178e25d385c08.png\" alt=\"\" style=\"width:80%\"/><br /><br />\r\n<b style=\"color:#2C5E99;\">2.新增分享功能，好东西要分享</b><br /><br />\r\n<img src=\"http://img.dm188.cn/dlb/upload/brand/201509/8ff9d4466f8e0786e572c2dd269ec9d6.png\" alt=\"\" style=\"width:80%\"/><br /><br />\r\n<b style=\"color:#2C5E99;\">3.新增我的客服，答疑解惑更方便</b><br /><br />\r\n<img src=\"http://img.dm188.cn/dlb/upload/brand/201509/3ca9fa5bae5a75573a6fc648ee095466.png\" alt=\"\" style=\"width:80%\"/><br /><br />\r\n<b style=\"color:#2C5E99;\">4.新增消息通知，系统重要通知早知道</b><br /><br />\r\n<img src=\"http://img.dm188.cn/dlb/upload/brand/201509/087e126366b5cd111b9af817ff04f978.png\" alt=\"\" style=\"width:80%\"/><br /><br />\r\n<b style=\"color:#2C5E99;\">5.新增常见问题，明明白白玩转钱富宝</b><br /><br />\r\n<img src=\"http://img.dm188.cn/dlb/upload/brand/201509/5bee9ea212df01c7c87e79da42498948.png\" alt=\"\" style=\"width:80%\"/><br /><br />\r\n<b style=\"color:#2C5E99;\">6.系统稳定性优化</b><br /><br />\r\n<img src=\"http://img.dm188.cn/dlb/upload/brand/201509/281e683eb0be5f3c8354f2fa2a4092d2.png\" alt=\"\" style=\"width:80%\"/><br /><br />\r\n</p>\r\n</div>\r\n<script>\r\nvar width=window.screen.availWidth;\r\nif(width<480)\r\n{\r\n	document.getElementById(\"container\").style.fontSize = \"35pt\";\r\n}\r\n</script>', '1', '1443091597', '1');
