INSERT INTO `qfb_article` VALUES ('14', '零钱提现说明', '1446000693', '<div id=\"container\">\r\n<p><b style=\"color:#2C5E99;\">一、提现限额</b>\r\n<br /><br />\r\n单笔1万，单日1万\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">二、到账时间</b>\r\n<br /><br />\r\n工作日14:00前申请提现，则在当日到账；\r\n<br />\r\n工作日14:00后申请提现，则在第二个工作日（T+1）23:59:59之前到账。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">三、支持银行卡</b>\r\n<br /><br />\r\n钱富宝支持以下银行储蓄卡：工商银行、中国银行、建设银行、邮政储蓄银行、招商银行、兴业银行、光大银行、广发银行、民生银行、平安银行、华夏银行、中信银行、浦东发展银行、广州农商银行、广州银行。\r\n<br /><br />\r\n<b style=\"color:#2C5E99;\">四、提现手续费</b>\r\n<br /><br />\r\n单笔提现金额大于等于100元，免手续费；\r\n<br />\r\n单笔提现少于100元将收取2元/笔的手续费。\r\n<br /><br />\r\n备注：本说明适用于V1.3.0以上版本。\r\n</p>\r\n</div>\r\n<script>\r\nvar width=window.screen.availWidth;\r\nif(width<480)\r\n{\r\n	document.getElementById(\"container\").style.fontSize = \"35pt\";\r\n}\r\n</script>', '1', '1446000693', '1');
INSERT INTO `qfb_article` VALUES ('16', '赎回说明', '1450152203', '<p>赎回说明：</p>\r\n<p>1.第一个理财周期为锁定期，不能赎回；</p>\r\n<p>2.第二个及以后的周期内赎回，周期内不产生任何收益；</p>\r\n<p>3.每笔投资订单在赎回时将全部赎回；</p>\r\n<p>4.赎回金额将在T+2工作日到账。<u></u></p>', '1', '1450152203', '1');
