INSERT INTO `qfb_article` VALUES ('18', '123', '1498816516', '<h2><a name=\"t1\" target=\"_blank\"></a>使用环境和条件</h2><p>有这样一种情况，php里面的关联数组，如果下面这样的数组数据：</p><p><strong>[php]</strong> <a href=\"http://blog.csdn.net/wzy_1988/article/details/8051911#\" class=\"ViewSource\" title=\"view plain\" target=\"_blank\">view plain</a> <a href=\"http://blog.csdn.net/wzy_1988/article/details/8051911#\" class=\"CopyToClipboard\" title=\"copy\" target=\"_blank\">copy</a></p> <a href=\"http://blog.csdn.net/wzy_1988/article/details/8051911#\" class=\"PrintSource\" title=\"print\" target=\"_blank\">print</a><a href=\"http://blog.csdn.net/wzy_1988/article/details/8051911#\" class=\"About\" title=\"?\" target=\"_blank\">?</a><ol><li><span class=\"vars\">$array</span> = <strong>array</strong> (  </li><li>        <strong>array</strong> (  </li><li>                <span class=\"string\">\'name\'</span> =&gt; <span class=\"string\">\"xiao\"</span>,  </li><li>                <span class=\"string\">\'age\'</span> =&gt; 3   </li><li>        ),  </li><li>        <strong>array</strong> (  </li><li>                <span class=\"string\">\'name\'</span> =&gt; <span class=\"string\">\'wang\'</span>,  </li><li>                <span class=\"string\">\'age\'</span> =&gt; 1   </li><li>        ),  </li><li>        <strong>array</strong> (  </li><li>                <span class=\"string\">\'name\'</span> =&gt; <span class=\"string\">\'chen\'</span>,  </li><li>                <span class=\"string\">\'age\'</span> =&gt; 2   </li><li>        )   </li><li>);  </li></ol><br>我们要对数组针对age字段进行排序，php自带的简单sort功能函数，显然都不能满足我们的需求，因此我们可以自己写一个快速排序代码，很快的实现我们的要求<h2><a name=\"t2\" target=\"_blank\"></a>注意情况</h2><p>php里面是没有指针存在的，所以当想要引用传递的时候，我们不能跟C代码一样，直接这样写quicksort(int *A, int begin, int end),而是要使用php的&运算符，将数组的地址传递跟快速排序函数，这样就能在php里实现引用传递而不是值传递</p><h2><a name=\"t3\" target=\"_blank\"></a>快速排序代码</h2><h3><a name=\"t4\" target=\"_blank\"></a>分治+归并实现快排</h3><p><strong>[php]</strong> <a href=\"http://blog.csdn.net/wzy_1988/article/details/8051911#\" class=\"ViewSource\" title=\"view plain\" target=\"_blank\">view plain</a> <a href=\"http://blog.csdn.net/wzy_1988/article/details/8051911#\" class=\"CopyToClipboard\" title=\"copy\" target=\"_blank\">copy</a></p> <a href=\"http://blog.csdn.net/wzy_1988/article/details/8051911#\" class=\"PrintSource\" title=\"print\" target=\"_blank\">print</a><a href=\"http://blog.csdn.net/wzy_1988/article/details/8051911#\" class=\"About\" title=\"?\" target=\"_blank\">?</a><ol><li><span class=\"comment\">/**</span> </li><li><span class=\"comment\"> * Description:获取中枢点的位置</span> </li><li><span class=\"comment\"> *</span> </li><li><span class=\"comment\"> * @param array $array             </span></li><li><span class=\"comment\"> * @param int $left             </span></li><li><span class=\"comment\"> * @param int $right             </span></li><li><span class=\"comment\"> * @param string $field             </span></li><li><span class=\"comment\"> * @return int</span> </li><li><span class=\"comment\"> */</span></li><li><strong>function</strong> fetchArrayPivot (&<span class=\"vars\">$array</span>, <span class=\"vars\">$left</span>, <span class=\"vars\">$right</span>, <span class=\"vars\">$field</span>)  </li><li>{  </li><li>    <span class=\"comment\">// 基准定义</span></li><li>    <span class=\"vars\">$stand</span> = <span class=\"vars\">$array</span>[<span class=\"vars\">$left</span>];  </li><li></li><li>    <span class=\"comment\">// 遍历数组</span></li><li>    <strong>while</strong> (<span class=\"vars\">$left</span> &lt; <span class=\"vars\">$right</span>) {  </li><li>        <strong>while</strong> (<span class=\"vars\">$left</span> &lt; <span class=\"vars\">$right</span> && <span class=\"vars\">$array</span>[<span class=\"vars\">$right</span>][<span class=\"vars\">$field</span>] &gt;= <span class=\"vars\">$stand</span>[<span class=\"vars\">$field</span>]) {  </li><li>            <span class=\"vars\">$right</span> --;  </li><li>        }  </li><li>        <strong>if</strong> (<span class=\"vars\">$left</span> &lt; <span class=\"vars\">$right</span>) {  </li><li>            <span class=\"vars\">$array</span>[<span class=\"vars\">$left</span> ++] = <span class=\"vars\">$array</span>[<span class=\"vars\">$right</span>];  </li><li>        }  </li><li></li><li>        <strong>while</strong> (<span class=\"vars\">$left</span> &lt; <span class=\"vars\">$right</span> && <span class=\"vars\">$array</span>[<span class=\"vars\">$left</span>][<span class=\"vars\">$field</span>] &lt;= <span class=\"vars\">$stand</span>[<span class=\"vars\">$field</span>]) {  </li><li>            <span class=\"vars\">$left</span> ++;  </li><li>        }  </li><li>        <strong>if</strong> (<span class=\"vars\">$left</span> &lt; <span class=\"vars\">$right</span>) {  </li><li>            <span class=\"vars\">$array</span>[<span class=\"vars\">$right</span> --] = <span class=\"vars\">$array</span>[<span class=\"vars\">$left</span>];  </li><li>        }  </li><li>    }  </li><li></li><li>    <span class=\"comment\">// 获取中枢点位置</span></li><li>    <span class=\"vars\">$array</span>[<span class=\"vars\">$left</span>] = <span class=\"vars\">$stand</span>;  </li><li></li><li>    <strong>return</strong> <span class=\"vars\">$left</span>;  </li><li>}  </li><li></li><li><span class=\"comment\">/**</span> </li><li><span class=\"comment\"> * Description:快速排序主程序</span> </li><li><span class=\"comment\"> *</span> </li><li><span class=\"comment\"> * @param array $array             </span></li><li><span class=\"comment\"> * @param int $begin             </span></li><li><span class=\"comment\"> * @param int $end             </span></li><li><span class=\"comment\"> * @param string $field             </span></li><li><span class=\"comment\"> */</span></li><li><strong>function</strong> quickSort (&<span class=\"vars\">$array</span>, <span class=\"vars\">$begin</span>, <span class=\"vars\">$end</span>, <span class=\"vars\">$field</span>)  </li><li>{  </li><li>    <span class=\"comment\">// 变量定义</span></li><li>    <span class=\"vars\">$pivot</span> = null;  </li><li></li><li>    <strong>if</strong> (<span class=\"vars\">$begin</span> &lt; <span class=\"vars\">$end</span>) {  </li><li>        <span class=\"vars\">$pivot</span> = fetchArrayPivot(<span class=\"vars\">$array</span>, <span class=\"vars\">$begin</span>, <span class=\"vars\">$end</span>, <span class=\"vars\">$field</span>);  </li><li>        quickSort(<span class=\"vars\">$array</span>, <span class=\"vars\">$begin</span>, <span class=\"vars\">$pivot</span> - 1, <span class=\"vars\">$field</span>);  </li><li>        quickSort(<span class=\"vars\">$array</span>, <span class=\"vars\">$pivot</span> + 1, <span class=\"vars\">$end</span>, <span class=\"vars\">$field</span>);  </li><li>    }  </li><li>}  </li></ol>\r\n<h4><a name=\"t5\" target=\"_blank\"></a>调用示例</h4><p><strong>[php]</strong> <a href=\"http://blog.csdn.net/wzy_1988/article/details/8051911#\" class=\"ViewSource\" title=\"view plain\" target=\"_blank\">view plain</a> <a href=\"http://blog.csdn.net/wzy_1988/article/details/8051911#\" class=\"CopyToClipboard\" title=\"copy\" target=\"_blank\">copy</a></p> <a href=\"http://blog.csdn.net/wzy_1988/article/details/8051911#\" class=\"PrintSource\" title=\"print\" target=\"_blank\">print</a><a href=\"http://blog.csdn.net/wzy_1988/article/details/8051911#\" class=\"About\" title=\"?\" target=\"_blank\">?</a><ol><li>&lt;?php  </li><li><span class=\"vars\">$array</span> = <strong>array</strong>(  </li><li>        <strong>array</strong>(  </li><li>                <span class=\"string\">\'name\'</span> =&gt; <span class=\"string\">\"xiao\"</span>,  </li><li>                <span class=\"string\">\'age\'</span> =&gt; 3  </li><li>        ),  </li><li>        <strong>array</strong>(  </li><li>                <span class=\"string\">\'name\'</span> =&gt; <span class=\"string\">\'wang\'</span>,  </li><li>                <span class=\"string\">\'age\'</span> =&gt; 1  </li><li>        ),  </li><li>        <strong>array</strong>(  </li><li>                <span class=\"string\">\'name\'</span> =&gt; <span class=\"string\">\'chen\'</span>,  </li><li>                <span class=\"string\">\'age\'</span> =&gt; 2  </li><li>        ),  </li><li>        <strong>array</strong>(  </li><li>                <span class=\"string\">\'name\'</span> =&gt; <span class=\"string\">\'zhengyi\'</span>,  </li><li>                <span class=\"string\">\'age\'</span> =&gt; 4  </li><li>        ),  </li><li>        <strong>array</strong>(  </li><li>                <span class=\"string\">\'name\'</span> =&gt; <span class=\"string\">\'chai\'</span>,  </li><li>                <span class=\"string\">\'age\'</span> =&gt; 14  </li><li>        )  </li><li>);  </li><li></li><li><span class=\"vars\">$begin</span> = getTime();  </li><li>quickSort(<span class=\"vars\">$array</span>, 0, <span class=\"func\">count</span>(<span class=\"vars\">$array</span>) - 1, <span class=\"string\">\'age\'</span>);  </li><li>print_r(<span class=\"vars\">$array</span>);  </li><li><span class=\"vars\">$end</span> = getTime();  </li><li><span class=\"vars\">$spend</span> = <span class=\"vars\">$end</span> - <span class=\"vars\">$begin</span>;  </li><li></li><li><span class=\"func\">echo</span> <span class=\"string\">\"花费时间为:\"</span>.<span class=\"vars\">$spend</span>.<span class=\"string\">\"秒\\n\"</span>;  </li><li></li><li><strong>function</strong> getTime()  </li><li>{  </li><li>    list(<span class=\"vars\">$msec</span>, <span class=\"vars\">$sec</span>) = <span class=\"func\">explode</span>(<span class=\"string\">\" \"</span>, microtime());  </li><li>    <strong>return</strong> (float)<span class=\"vars\">$msec</span> + (float)<span class=\"vars\">$sec</span>;  </li><li>}  </li></ol>\r\n<h4><a name=\"t6\" target=\"_blank\"></a>实现效果</h4><p><img src=\"http://img.blog.csdn.net/20130508142301990\" alt=\"\"><br></p><h3><a name=\"t7\" target=\"_blank\"></a>调用系统的usort</h3><p>类似c里面调用qsort，需要自己写比较函数，跟c类似</p><p><strong>[php]</strong> <a href=\"http://blog.csdn.net/wzy_1988/article/details/8051911#\" class=\"ViewSource\" title=\"view plain\" target=\"_blank\">view plain</a> <a href=\"http://blog.csdn.net/wzy_1988/article/details/8051911#\" class=\"CopyToClipboard\" title=\"copy\" target=\"_blank\">copy</a></p> <a href=\"http://blog.csdn.net/wzy_1988/article/details/8051911#\" class=\"PrintSource\" title=\"print\" target=\"_blank\">print</a><a href=\"http://blog.csdn.net/wzy_1988/article/details/8051911#\" class=\"About\" title=\"?\" target=\"_blank\">?</a><ol><li><span class=\"comment\">/**</span> </li><li><span class=\"comment\"> * Description:类似于c中qsort的比较函数</span> </li><li><span class=\"comment\"> *  </span></li><li><span class=\"comment\"> * @param array $a             </span></li><li><span class=\"comment\"> * @param array $b             </span></li><li><span class=\"comment\"> * @param string $field             </span></li><li><span class=\"comment\"> * @return int</span> </li><li><span class=\"comment\"> */</span></li><li><strong>function</strong> compare (<span class=\"vars\">$a</span>, <span class=\"vars\">$b</span>)  </li><li>{  </li><li>    <strong>return</strong> <span class=\"vars\">$a</span>[<span class=\"string\">\'age\'</span>] - <span class=\"vars\">$b</span>[<span class=\"string\">\'age\'</span>];  </li><li>}  </li><li>usort(<span class=\"vars\">$array</span>, <span class=\"string\">\"compare\"</span>);  </li></ol>\r\n<h4><a name=\"t8\" target=\"_blank\"></a>调用示例</h4><p><strong>[php]</strong> <a href=\"http://blog.csdn.net/wzy_1988/article/details/8051911#\" class=\"ViewSource\" title=\"view plain\" target=\"_blank\">view plain</a> <a href=\"http://blog.csdn.net/wzy_1988/article/details/8051911#\" class=\"CopyToClipboard\" title=\"copy\" target=\"_blank\">copy</a></p> <a href=\"http://blog.csdn.net/wzy_1988/article/details/8051911#\" class=\"PrintSource\" title=\"print\" target=\"_blank\">print</a><a href=\"http://blog.csdn.net/wzy_1988/article/details/8051911#\" class=\"About\" title=\"?\" target=\"_blank\">?</a><ol><li>&lt;?php  </li><li><span class=\"vars\">$array</span> = <strong>array</strong>(  </li><li>        <strong>array</strong>(  </li><li>                <span class=\"string\">\'name\'</span> =&gt; <span class=\"string\">\"xiao\"</span>,  </li><li>                <span class=\"string\">\'age\'</span> =&gt; 3  </li><li>        ),  </li><li>        <strong>array</strong>(  </li><li>                <span class=\"string\">\'name\'</span> =&gt; <span class=\"string\">\'wang\'</span>,  </li><li>                <span class=\"string\">\'age\'</span> =&gt; 1  </li><li>        ),  </li><li>        <strong>array</strong>(  </li><li>                <span class=\"string\">\'name\'</span> =&gt; <span class=\"string\">\'chen\'</span>,  </li><li>                <span class=\"string\">\'age\'</span> =&gt; 2  </li><li>        ),  </li><li>        <strong>array</strong>(  </li><li>                <span class=\"string\">\'name\'</span> =&gt; <span class=\"string\">\'zhengyi\'</span>,  </li><li>                <span class=\"string\">\'age\'</span> =&gt; 4  </li><li>        ),  </li><li>        <strong>array</strong>(  </li><li>                <span class=\"string\">\'name\'</span> =&gt; <span class=\"string\">\'chai\'</span>,  </li><li>                <span class=\"string\">\'age\'</span> =&gt; 14  </li><li>        )  </li><li>);  </li><li></li><li><span class=\"vars\">$begin</span> = getTime();  </li><li>usort(<span class=\"vars\">$array</span>, <span class=\"string\">\"compare\"</span>);  </li><li>print_r(<span class=\"vars\">$array</span>);  </li><li><span class=\"vars\">$end</span> = getTime();  </li><li><span class=\"vars\">$spend</span> = <span class=\"vars\">$end</span> - <span class=\"vars\">$begin</span>;  </li><li></li><li><span class=\"func\">echo</span> <span class=\"string\">\"花费时间为:\"</span> . <span class=\"vars\">$spend</span> . <span class=\"string\">\"秒\\n\"</span>;  </li><li></li><li><strong>function</strong> getTime ()  </li><li>{  </li><li>    list (<span class=\"vars\">$msec</span>, <span class=\"vars\">$sec</span>) = <span class=\"func\">explode</span>(<span class=\"string\">\" \"</span>, microtime());  </li><li>    <strong>return</strong> (float) <span class=\"vars\">$msec</span> + (float) <span class=\"vars\">$sec</span>;  </li><li>}  </li></ol>\r\n<h4><a name=\"t9\" target=\"_blank\"></a>实现效果</h4><p><img src=\"http://img.blog.csdn.net/20130508143624069\" alt=\"\"><br></p><p><a href=\"http://blog.csdn.net/wzy_1988/article/details/8051911#\" class=\"bds_more\" data-cmd=\"more\" target=\"_blank\"></a><a href=\"http://blog.csdn.net/wzy_1988/article/details/8051911#\" class=\"bds_qzone\" data-cmd=\"qzone\" title=\"分享到QQ空间\" target=\"_blank\"></a><a href=\"http://blog.csdn.net/wzy_1988/article/details/8051911#\" class=\"bds_tsina\" data-cmd=\"tsina\" title=\"分享到新浪微博\" target=\"_blank\"></a><a href=\"http://blog.csdn.net/wzy_1988/article/details/8051911#\" class=\"bds_tqq\" data-cmd=\"tqq\" title=\"分享到腾讯微博\" target=\"_blank\"></a><a href=\"http://blog.csdn.net/wzy_1988/article/details/8051911#\" class=\"bds_renren\" data-cmd=\"renren\" title=\"分享到人人网\" target=\"_blank\"></a><a href=\"http://blog.csdn.net/wzy_1988/article/details/8051911#\" class=\"bds_weixin\" data-cmd=\"weixin\" title=\"分享到微信\" target=\"_blank\"></a></p><dl><dt>顶</dt><dd>4</dd></dl> <dl><dt>踩</dt><dd>0</dd></dl><p><a target=\"_blank\"> </a></p><p><a target=\"_blank\"> </a></p><ul><li>上一篇<a href=\"http://blog.csdn.net/zinss26914/article/details/8051230\">快速排序——成绩排序</a></li><li>下一篇<a href=\"http://blog.csdn.net/zinss26914/article/details/8058632\">整数逆序（c语言实现）</a></li></ul>  相关文章推荐<ul><li>• <a href=\"http://blog.csdn.net/yueruitao/article/details/73195542\" title=\"php面试题\" strategy=\"BlogCommendFromCsdn\" target=\"_blank\">php面试题</a></li><li>• <a href=\"http://frank1988.iteye.com/blog/2020338\" title=\"oracle 分割字符串方法以及关联数组与bulk into的使用\" strategy=\"BlogCommendFromCsdn\" target=\"_blank\">oracle 分割字符串方法以及关联数组与