INSERT INTO `qfb_product_detail` VALUES ('98', '', '<p>前公司正在进行软件公司运营的筹备工作（研发部门后续会调整归属为软件公司），考虑到软件公司的特性及结合公司领导人的管理理念，经公司领导批准，决定对软件公司实施弹性考勤工作制管理。具体内容如下：</p>  <ul><li>弹性考勤工作制定义</li><li>弹性考勤工作制原则<strong></strong></li></ul>  <p>是指在不影响项目及工作进度，确保完成团队规定的工作任务及固定的工作时间时长的前提下，员工可根据部门工作管理进行弹性考勤。</p>    <ul><li>对于弹性考勤的自由灵活，同时需要各级管理人员适时调整管理方式和方法，以达到管理目标的要求。<strong></strong></li><li>实施弹性考勤的员工还需按照公司整体考勤管理要求照例到岗、离岗进行刷卡考勤，不管何时上班或下班都需要刷卡考勤。<strong></strong></li></ul><p>实施弹性考勤工作制后，原正常工作日的加班不再</p><p>目前公司正在进行软件公司运营的筹备工作（研发部门后续会调整归属为软件公司），考虑到软件公司的特性及结合公司领导人的管理理念，经公司领导批准，决定对软件公司实施弹性考勤工作制管理。具体内容如下：</p><ul><li>弹性考勤工作制定义</li><li>弹性考勤工作制原则<strong></strong></li></ul><p>是指在不影响项目及工作进度，确保完成团队规定的工作任务及固定的工作时间时长的前提下，员工可根据部门工作管理进行弹性考勤。</p><ul><li>对于弹性考勤的自由灵活，同时需要各级管理人员适时调整管理方式和方法，以达到管理目标的要求。<strong></strong></li><li>实施弹性考勤的员工还需按照公司整体考勤管理要求照例到岗、离岗进行刷卡考勤，不管何时上班或下班都需要刷卡考勤。<strong></strong></li></ul><p>            实施弹性考勤工作制后，原正常工作日的加班不再<br></p><p><img src=\"http://imgs.qianfb.com/uploads/1/UBw88eDznEO0kLAm6DNMbUporPLaQETI.png\"></p><p>目前公司正在进行软件公司运营的筹备工作（研发部门后续会调整归属为软件公司），考虑到软件公司的特性及结合公司领导人的管理理念，经公司领导批准，决定对软件公司实施弹性考勤工作制管理。具体内容如下：</p><ul><li>弹性考勤工作制定义</li><li>弹性考勤工作制原则<strong></strong></li></ul><p>是指在不影响项目及工作进度，确保完成团队规定的工作任务及固定的工作时间时长的前提下，员工可根据部门工作管理进行弹性考勤。</p><ul><li>对于弹性考勤的自由灵活，同时需要各级管理人员适时调整管理方式和方法，以达到管理目标的要求。<strong></strong></li><li>实施弹性考勤的员工还需按照公司整体考勤管理要求照例到岗、离岗进行刷卡考勤，不管何时上班或下班都需要刷卡考勤。<strong></strong></li></ul><p>            实施弹性考勤工作制后，原正常工作日的加班不再<br></p><p><img src=\"http://imgs.qianfb.com/uploads/1/eDHgvBFGRf2Ms_Fkf1lZR1owQQNhgPni.png\"></p><p>目前公司正在进行软件公司运营的筹备工作（研发部门后续会调整归属为软件公司），考虑到软件公司的特性及结合公司领导人的管理理念，经公司领导批准，决定对软件公司实施弹性考勤工作制管理。具体内容如下：</p><ul><li>弹性考勤工作制定义</li><li>弹性考勤工作制原则<strong></strong></li></ul><p>是指在不影响项目及工作进度，确保完成团队规定的工作任务及固定的工作时间时长的前提下，员工可根据部门工作管理进行弹性考勤。</p><ul><li>对于弹性考勤的自由灵活，同时需要各级管理人员适时调整管理方式和方法，以达到管理目标的要求。<strong></strong></li><li>实施弹性考勤的员工还需按照公司整体考勤管理要求照例到岗、离岗进行刷卡考勤，不管何时上班或下班都需要刷卡考勤。<strong></strong></li></ul><p>            实施弹性考勤工作制后，原正常工作日的加班不再<br></p>', null);
