                              `relations` varchar(10000) NOT NULL DEFAULT '' COMMENT '用户关系',
                              `r_member_id` int(11) NOT NULL COMMENT '推荐人id',
                              `layer` tinyint(4) NOT NULL COMMENT '层级关系',
