                                 `time` varchar(50) NOT NULL COMMENT '服务时间',
                                 `bottom` varchar(100) NOT NULL COMMENT '底栏字样',
                                 `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态，1：展示 2：不展示',
                                 `logo` varchar(50) NOT NULL DEFAULT '' COMMENT '首页LOGO图',
                                 PRIMARY KEY (`id`)
