-- ----------------------------
-- View structure for vmember
-- ----------------------------
DROP VIEW IF EXISTS `vmember`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`127.0.0.1` SQL SECURITY DEFINER VIEW `vmember` AS select `mem`.`id` AS `vid`,`mem`.`level` AS `vlevel`,`mem`.`r_member_id` AS `vr_member_id`,`mem`.`mobile` AS `vmobile`,`mem`.`channel_id` AS `vchannel_id`,`mem`.`last_access_time` AS `vlast_access_time`,`mem`.`last_ip` AS `vlast_ip`,`mem`.`account` AS `vaccount`,`mem`.`member_type` AS `vmember_type`,`mem`.`is_dredge` AS `vis_dredge`,`um`.`status` AS `vstatus`,`um`.`source` AS `vsource`,`minfo`.`create_time` AS `vcreate_time`,`minfo`.`realname` AS `vrealname`,`minfo`.`card_no` AS `vcard_no`,`minfo`.`card_type` AS `vcard_type`,`money`.`live_money` AS `vlive_money`,`money`.`pre_live_money` AS `vpre_live_money`,`money`.`fix_money` AS `vfix_money`,`money`.`money` AS `vmoney`,`minfo`.`is_verify` AS `vis_verify` from (((`dm_qfb`.`qfb_member` `mem` left join `dm_qfb`.`qfb_member_money` `money` on((`mem`.`id` = `money`.`member_id`))) left join `dm_qfb`.`qfb_member_info` `minfo` on((`mem`.`id` = `minfo`.`member_id`))) left join `dm_ucenter`.`dmu_member` `um` on((`mem`.`id` = `um`.`id`))) ;

-- ----------------------------
-- View structure for vproductrate
-- ----------------------------
DROP VIEW IF EXISTS `vproductrate`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`127.0.0.1` SQL SECURITY DEFINER VIEW `vproductrate` AS (select `qfb_product`.`id` AS `id`,`qfb_product`.`product_type` AS `product_type`,`qfb_product`.`year_rate` AS `year_rate`,`qfb_product`.`profit_type` AS `profit_type`,`qfb_product`.`profit_day` AS `profit_day`,`qfb_product`.`invest_day` AS `invest_day`,`qfb_product`.`status` AS `status`,`qfb_profit_settings`.`direct_rate` AS `direct_rate`,`qfb_profit_settings`.`indirect_rate` AS `indirect_rate`,`qfb_profit_settings`.`share_rate` AS `share_rate`,`qfb_profit_settings`.`recommond_rate` AS `recommond_rate`,`qfb_profit_settings`.`province_rate` AS `province_rate`,`qfb_profit_settings`.`city_rate` AS `city_rate`,`qfb_profit_settings`.`area_rate` AS `area_rate`,`qfb_profit_settings`.`agent_rate` AS `agent_rate`,`qfb_profit_settings`.`manage_rate` AS `manage_rate` from (`qfb_product` left join `qfb_profit_settings` on((`qfb_product`.`id` = `qfb_profit_settings`.`product_id`)))) ;
